INSERT INTO Papers (paperId, title, abstract, track, status, submissionType, submitterId, fileId, tentativeStatus)
VALUES
	(1,NULL,NULL,NULL,NULL,5,558,'RW5WKTY86V',NULL),
	(2,NULL,NULL,NULL,NULL,1,558,'Z1SHHA0UZN',NULL),
	(3,NULL,NULL,NULL,NULL,1,559,'YO6IQY72NT',NULL),
	(4,'DEVELOPMENT+OF+MOBILE+APPLICATION++FOR++INCIDENT+REPORTING++','The+study+entitled+%E2%80%9CDevelopment+of+Mobile+Application+for+Incident+Reporting%E2%80%9D+is+an+application+that+aimed+to+report+and+respond+to+crime+incidents+that+may+occur+in+the+Philippines+community.+It+includes+two+main+applications+such+as+Crime+Reporting%2C+Crime+Responder+and+the+website.+The+Crime+Reporting+application+used+by+the+victim+or+witness%2C+to+submit+an+incident+report+with+photos+that+are+then+coordinated+to+either+the+nearest+barangay+or+police+station.+The+Crime+Responder+application+used+by+the+barangay+or+police+officials+for+notification+and+immediate+response+on+the+given+report.+The+website+for+incident+demographics.++The+application+runs+in+Android+phones+with+a+4.4+to+6.0+version+and+has+an+internet+connection.+The+30+participants%2C+including+10+end-users%2C+5+police+officers%2C+5+barangay+officers%2C+7+IT+teachers%2C+and+3+Android+programmers+using+the+ISO+25010+Model+as+an+assessment+tool%2C+assessed+it.',NULL,'Submitted',7,561,'9WJWV7VTQH','Accepted as a Poster'),
	(5,'Digital+Culture+and+Information%3A+A+Library-Based+Minor+Focusing+on+How+Modern+Information+Access+Impacts+Society','In+the+fall+of+2018%2C+the+Washington+and+Lee+University+Library+launched+an+interdisciplinary+minor+called+Digital+Culture+and+Information+%28DCI%29+that+aims+to+fill+a+curricular+gap+between+how+information+exists+and+how+it+is+used.++Built+from+a+successful+campus-wide+digital+humanities+initiative%2C+DCI+challenges+students+to+become+more+highly+literate+consumers+and+creators+of+information+through+coursework+focusing+on+data+analysis%2C+website+development%2C+and+the+impact+of+electronic+communication+on+society.++This+poster+presents+the+summation+of+a+summer+sabbatical+project+analyzing+programs+worldwide+similar+to+DCI%2C+how+our+minor+differs%2C+and+how+we+can+grow.',NULL,'Accepted',4,562,'TSWGRYI6YP','Accepted'),
	(6,'ACTOR-NETWORK+THEORY+APPROACH+USING+M-LEARNING+TECHNOLOGIES+IN+THE+SENIOR+HIGH+SCHOOL+AS+PEDAGOGY','Actor-Network+Theory+provides+an+approach+to+understand+how+both+social+action+shapes+technology+and+how+technological+innovations+shape+action.+Thus%2C+Actor-Network+Theory+acts+as+a+toolkit+to+explore+how+human+and+non-human+actions+interact+with+one+another+to+make+sense+of+their+world+%28Latour%2C+2005%29.+Therefore%2C+the+researchers+adopted+the+phases+of+actor-network+theory+approach+for+the+Public+Senior+High+School+with+the+use+of+M-learning+technologies+as+pedagogy+since+most+of+them+have+been+experiencing+lack+of+learning+materials+and+textbooks+and+teachers+are+finding+other+ways+on+how+to+provide+learning+materials+for+the+learners.+That+is+why+the+study+used+the+free+and+open+source+educational+software+and+online+sites+to+support+and+sustain+the+learning+needs+of+the+students.+Using+the+M-learning+site+and+applications+such+as+Edmodo%2C+Moodle+and+M-Technologies+like+mobile+phone+%28android%2C+iOs%2C+etc.%29+devices%2C+tablets+and+electronic+gadgets+everyone+%28both+teachers+and+students%29+can+access+the+information+anytime+and+anywhere.%0AOne+of+the+results+of+the+study+shows+that+it+is+moderately+accepted+in+terms+of+using+the+free+and+open+source+Edmodo+application.+Also%2C+the+respondents+moderately+accepted+the+usage+of+some+of+the+devices+that+may+be+used+in+educational+pedagogical+strategy.+The+satisfaction+of+ANT+approach+with+the+use+of+the+M-learning+technologies+in+the+Public+Senior+High+School+in+terms+of+M-learning+materials%2C+activities+and+assessment+was+highly+satisfied+with+a+total+mean+of+4.56.+Lastly%2C+the+level+of+agreement+of+ANT+approach+with+the+use+of+the+M-learning+technologies+as+pedagogy+in+terms+of+functionality%2C+efficiency%2C+usability%2C+availability%2C+and+reliability+was+strongly+agreed+by+the+students.+%0ATherefore%2C+actors-humans+have+a+big+factor+to+manage+the+non-human+entities+in+education.+The+two+has+a+big+role+in+our+education+especially+in+the+Public+Senior+High+School.%0AAs+what+the+ANT+approach+shows+with+the+use+of+different+M-learning+technologies%2C+it+is+significant+to+impart+in+education+as+pedagogical+strategy+of+the+teachers.++It+is+effective+so+that+no+learners+will+be+left+behind+from+the+lessons+discussed+that+are+given+by+the+teachers.%0AThe+researchers+proved+that+using+the+M-technologies%2C+they+are+highly+accepted+in+our+education.+Open+source+M-learning+that+are+used+in+education+gets+a+high+satisfactory+when+it+comes+to+the+functionality%2C+reliability%2C+usability+and+efficiency+of+ANT+approach.+Lastly%2C+the+study+shows+that+the+use+of+M-learning+technologies+is+highly+accepted+by+the+students+of+the+Public+Senior+High+School.%0A',NULL,'Rejected',7,566,'997P4B7QTR','Rejected'),
	(7,'Teaching+Database+for+Freshmen%3A+A+Two-Thread+Model','We+address+the+challenge+of+teaching+a+database+course+for+freshmen+CS%2FIT+majors%3A+namely+their+limited+background%2C+coupled+with+the+material%27s+mixture+of+language+%28e.g.%2C+SQL%29+and+abstract+theory+%28e.g.%2C+normalization%29+--+hard+even+for+upperclassmen.+In+this+paper%2C+we+propose+a+new+two-thread+model%3A+one+thread+of+theory+and+another+of+practice+which+are+relatively+independent+and+self-contained+%28compared+to+a+typical+%22Lecture+%2B+Lab%22+design%29.+To+provide+students+extensive+exercises+on+SQL%2C+the+practice+thread+has+labs+that+expose+them+to+SQL+statements+starting+Week+1.+When+applicable%2C+labs+purposely+anticipate+related+components+in+the+theory+thread.+Also+we+approach+abstract+concepts+%28e.g.%2C+normalization%29+using+an+example-based+method+that+generalizes+patterns+extracted+from+examples.+We+have+applied+this+two-thread+model+with+our+freshmen+for+the+last+few+semesters%2C+and+their+responses+have+been+very+positive.+We+share+some+of+this+feedback+as+well+as+the+learned+lessons+with+the+hope+to+enlighten+the+teaching+of+database+courses+and+other+freshmen+courses+in+other+institutions.',NULL,'Accepted as a Lightning Talk',1,218,'SCSMSAY6YE','Accepted as a Lightning Talk'),
	(8,'Student-Centered+Learning%3A+Create+a+Significant+Learning+Experience+by+Using+Flipped+Classroom+Approach','This+lightning-talk+aims+to+invoke+discussions+on+promoting+student-centered+learning+in+IT+education.+We+will+present+our+pedagogical+experiment+using+flipped+classroom+approach+to+create+significant+learning+experiences+in+delivering+a+core+IT+course.+The+design%2C+outcome%2C+and+student+feedback+will+be+discussed.',NULL,'Accepted',5,233,'1LXTQHYQS7','Accepted'),
	(9,'A+Process+of+Transitioning+to+the+New+ABET+Criterion+3%3A++An+IT+Degree+Program%E2%80%99s+Approach+','This+talk+discusses+an+effective+and+efficient+process+that+a+BSIT+program+has+undergone+for+transitioning+to+the+new+ABET+Student+Outcomes+and+some+preliminary+results%2C+which+may+benefit+other+computing+programs+in+preparation+for+an+ABET+accreditation+visit+in+2019+or+beyond.',NULL,'Accepted',5,9,'NS45UAX7P4','Accepted'),
	(10,'Human+Risk+Factors+in+Cybersecurity','Phishing+emails+present+a+serious+threat+to+any+institution%2C+costing+individuals+and+companies+millions+of+dollars+every+year+in+dam-ages.+This+paper+attempts+to+assess+the+human+risks+of+a+mid-sized+state+university+by+conducting+an+experiment+in+which+users+were+phished+multiple+times+and+presented+with+different+training+types.+The+phishing+emails+contained+links+to+a+controlled+server+that+prompted+users+to+enter+login+credentials+into+a+spoofed+university+login+page+and+gathered+relevant+data.+Our+analysis+shows+that+44.3%25+of+users+clicked+on+at+least+one+of+the+phishing+emails%2C+and+18.6%25+entered+valid+credentials.+Additionally%2C+we+found+that+the+majority+of+users+%2864.5%25%29+responded+to+the+phishing+emails+via+mobile+devices+running+iOS+or+Android+and+we+received+98%25+of+responses+within+the+first+twelve+hours+of+sending+the+emails.+Finally%2C+our+data+suggests+that+the+most+effective+training+method+to+prevent+users+from+clicking+subsequent+phishing+emails+was+to+provide+easy-to-read+documents+with+visual+cues+when+users+were+%E2%80%9Ccaught%E2%80%9Din+the+act.',NULL,'Accepted',7,570,'V6V14ZERKV','Accepted'),
	(11,NULL,NULL,NULL,'Undecided',2,571,'NSPT8PLQ3E','Undecided'),
	(12,'A+New+Methodology+for+a+Functional+and+Logic+Programming+Course','We+have+been+giving+a+course+on+functional+and+logic+programming+models+for+third+and+fourth+grade+students+of+a+university+in+Japan.+For+students+mostly+trained+in+imperative+programming+%28e.g.%2C+the+C+language%29+and+object-oriented+programming+%28e.g.%2C+the+Java+language%29%2C+transitioning+to+the+logic+paradigm+after+making+significant+efforts+to+first+get+used+to+the+functional+paradigm+imposes+a+really+heavy+burden%2C+with+students+often+%22throwing+the+towel%22+for+this+final+step+%28i.e.%2C+on+to+logic+programming+and+relational+thinking%29.+For+the+2018+academic+year%2C+we+have+experimented+a+novel+pedagogic+method+to+smooth+the+transition+between+these+two+paradigms%2C+relying+on+the+intermediate+language+Curry.+In+this+paper%2C+we+start+by+describing+the+proposed+method+by+giving+some+details+of+the+course+before+quantitatively+evaluating+our+approach+by+conducting+several+comparative+experiments.+The+obtained+results+are+very+promising+in+that+they+show+significantly+increased+examination+marks+and+several+positive+aspects+at+the+course+evaluation+by+students.',NULL,'Accepted',7,572,'7G4HYWL96T','Accepted'),
	(13,'Using+Instruction+Writing+in+Introductory+Computing+Courses+to+Aid+Problem-Solving','Teaching+students+problem-solving+skills+is+the+biggest+challenge+for+many+computing+programs.+The+usual+emphasis+on+the+programming+language+in+the+introduction+to+computing+courses+distracts+students+from+designing+solutions.+Introducing+problem-solving+using+pseudocode+does+not+solve+this+problem+either%3B+our+research+shows+that+students+treat+pseudocode+as+just+another+programming+language+and+fixate+on+syntax+rather+than+the+solution+design.+The+paper+demonstrates+how+technical+writing+techniques%2Fstrategies+can+be+used+in+an+introductory+programming+course.+Students+develop+programming+code+through+writing+instructions+and+have+to+submit+the+documentation+of+problem-solving+process+that+includes%3A+1%29+the+problem+statement%3B+2%29+used+decomposition+strategies%2C+3%29+questions+to+identify+deficiencies%2C+and+4%29+resolution+of+identified+deficiencies+through+iterative+refinement.+This+approach+requires+students+to+think+about+what+questions+they+need+to+ask+in+designing+a+solution.+Results+indicate+that+this+approach+helps+developing+problem-solving+skills+and+improves+the+student+success+rate+in+the+first+programming+course.',NULL,'Accepted as a Poster',1,228,'F1ATWAR34D','Accepted as a Poster'),
	(14,'Designing+the+IT+Capstone+Course%3A+A+Systematic+Literature+Review','This+talk+discusses+the+preparation+to+design+a+newly+required+Capstone+course+as+part+of+a+larger+curriculum+update+in+an+IT+degree+program+at+a+large+midwestern+university.+To+ensure+a+quality+experience+for+students%2C+the+course+is+being+developed+based+on+best+practices+identified+through+a+systematic+literature+review.+A+proper+review+is+comprised+of+discrete+activities+that+ensure+a+rigorous+process+to+review+current+evidence+related+to+a+particular+research+question.+The+review+is+currently+in+early+stages.+Progress+in+establishing+methods+and+summarizing+findings+will+be+discussed.',NULL,'Accepted',5,576,'HZD3Q82S7G','Accepted'),
	(15,'Fundamentals+of+Ethical+Hacking+and+Penetration+Testing+','This+workshop+provides+the+fundamental+concepts+of+Ethical+Hacking+with+hand+on+practice+on+many+Penetration+Testing+tools.+The+workshop+is+organized+mainly+in+two+sessions%3B+Theoretical+concepts+and+Practical+working+on+Ethical+Hacking+tools+%28Hands+on+Labs%29.+The+hands-on+practical+labs+involve+Reconnaissance%2C+Scanning%2C+Vulnerability+Assessment%2C+Web+Application+attack+%28SQL+injection%29+and+malware+injection+concepts+that+eventually+give+the+participants+a+real+time+exposure+of+a+complete+cyber-attack+process+and+recommendations+for+avoidance.+The+participants+will+be+provided+with+all+Ethical+Hacking+tools+kit+which+they+can+use+for+further+learning+and+improve+their+security+analysis+skills.+',NULL,'Accepted',3,581,'56OSE8H95G','Accepted'),
	(16,'Impact+of+Practices+Tests+on+A%2B+Certification+Exam+Score%3A+An+Initial+Study','XX+University+%28XXX%29+is+an+accredited+online+university+with+a+2018+total+enrollment+of+xxxxxx%2C+and+the+College+of+Information+and+Technology+%28COIT%29+enrollment+is+XXXXX.++COIT+utilizes+61+IT+certifications+across+degrees.++This+paper+examines+the+correlation+between+student+scores+on+IT+the+A%2B+certification+exams+and+two+vendors+practice+tests.+++Only+weak+correlations+were+found%3B+data+analysis+showed+that+students+do+not+take+advantage+of+all+the+practice+tests%2C+and+do+not+utilize+the+more+mature+and+respected+practice+tests.+We+recommend+that+the+order+of+test+be+changed.',NULL,'Rejected',7,583,'G68RB7YPE4','Rejected'),
	(17,'Equipping+DoD+Workforce+with+SAP+Competencies','Many+US+Department+of+Defense+%28DoD%29+services+and+agencies+have+embarked+on+digital+transformation+journeys+leveraging+SAP.+The+benefits+of+a+well+educated+workforce+are+well+recognized+and+understood.+However%2C+US+DoD+employees+%28military+and+civilians%29+do+not+typically+have+access+to+tailored+programs+to+help+them+build+SAP+competencies+such+as+the+ability+to+understand+how+the+various+domain+%28e.g.+finance%2C+logistics%2C+and+human+capital+management%29%2C+areas+are+integrated%2C+analytics%2C+and+the+Internet+of+Things+%28IoT%29+that+can+be+applied+to+organization%27s+efforts.+SAP+has+already+partnered+with+many+higher+education+institutions+through+its+University+Alliance+and+NextGen+Programs.+This+lightning+talk+will+share+some+of+the+successes+achieved+in+equipping+DoD+Workforce+with+SAP+Competencies+through+the+University+Alliance+and+NextGen+Programs.',NULL,NULL,5,584,'AUE9UO8YHI',NULL),
	(18,NULL,NULL,NULL,NULL,5,585,'AH6MS9FM56',NULL),
	(19,'Expanding+Learners+as+Designers+%28LasD%29+in+IT','The+trend+to+actively+include+learners+as+designers+in+higher+education+continues+to+positively+improve+learning+outcomes.+This+paper+expands+this+application+in+a+Learners+as+Designers+%28LasD%29+process+in+an+upper+level+undergraduate+course+in+organizational+networking+and+communication+tools.+Students+participated+in+selection+of+tools%2C+as+well+as+associated+readings+and+assessment+rubrics.+Nineteen+students+participated+in+the+study.+A+survey+comprising+open-ended+questions+was+distributed%2C+and+a+follow-up+interview+was+conducted+with+select+participants.+A+qualitative+content+analysis+was+performed+to+understand+how+students+think+about+being+an+active+part+of+the+course+development.+Initial+results+indicate+that+students+appreciated+having+a+voice+in+the+design+process%2C+but+found+certain+parts+of+the+implementation+needed+more+structure.',NULL,'Accepted',7,586,'F3U9DIBQ96','Accepted'),
	(20,'Labs+and+Three-Stage+Learning+Process+Used+in+a++Cyber+Security+Learning+System','This+paper+discusses+labs+and+a+three-stage+learning+process+to+help+students+learn+the+contents+of+cyber+security.+A+system+infrastructure+that+includes+a+number+of+identical%2C+secure%2C+and+isolated+learning+environments+is+developed.+Each+learning+environment+includes+a+set+of+cyber+security+labs+with+each+lab+consisting+of+two+sub-labs%3A+attack+and+defense.+These+labs+facilitate+students+learning+of+theoretical+knowledge+and+allow+them+to+practice+hands-on+activity+of+attack+and+defense.+Each+lab+involves+a+three-stage+learning+process%3A+learning%2C+assessment%2C+and+engagement.+The+learning+environments+are+implemented+by+using+virtualization+technology.+Multiple+virtual+machines+%28VMs%29+are+implemented+in+each+learning+environment+and+those+machines+serve+tasks+of+attack+and+defense.+In+addition%2C+the+system+infrastructure+allows+interaction+among+learning+environments%2C+therefore+making+it+more+similar+to+a+realistic+world+network.+',NULL,'Accepted as a Lightning Talk',1,18,'XNN2PTL2TQ','Accepted as a Lightning Talk'),
	(21,'Virtual+Reality+and+its+Impact+on+Learning+Success','For+elementary+schools%2C+the+question+arises+as+to+whether+the+use+of+Virtual+Reality+%28VR%29+can+lead+to+better+learning+success+for+pupils.+A+field+experiment+was+chosen+as+the+methodology+for+investigating+this+question.+A+total+of+82+pupils+from+four+first+and+third+secondary+school+classes+were+available+for+this+field+experiment.+They+were+randomly+assigned+to+a+group+per+class%2C+taking+gender+into+account.+Both+groups+attended+a+pre-test+one+week+before+the+respective+course+unit+in+order+to+identify+any+previous+knowledge.+One+week+after+the+course+unit%2C+both+groups+again+completed+the+post-test.+The+tests+were+designed+in+such+a+way+that+equal+weight+was+attached+to+each+learning+objective+of+the+learning+units.+During+the+evaluation%2C+the+individual+learning+success%2C+i.e.+the+difference+between+the+post-test+and+the+pre-test%2C+was+calculated+for+each+pupil.+No+significant+differences+in+learning+success+between+the+classical+and+VR+units+could+be+demonstrated.+Apart+from+that%2C+the+VR+learning+unit+led+to+a+positive+result+and+was+widely+accepted+by+the+students.+However%2C+it+has+also+been+shown+that+it+is+very+difficult+to+design+equivalent+learning+units+and+to+compare+them+fairly.+For+future+research%2C+it+is+recommended+to+focus+on+the+question+of+how+a+VR+learning+unit+can+be+anchored+complementarily+in+a+higher-level+curriculum.+In+this+way%2C+the+advantages+of+both+types+of+learning+units+can+be+optimally+combined.',NULL,'Accepted as a Lightning Talk',7,593,'HHQ8A3NX0P','Accepted as a Lightning Talk'),
	(22,'Confessions+of+an+IT+Certification+High+Priest','For+the+past+20%2B++years%2C++I+have+taught+IT+certifications+at+a+university%2C+a+community+college%2C+and+tech+centers.+++I++am+a++Microsoft+Certified+Trainer+and+Master+Certified+Novell+Instructor.++I+have+taught+Cisco%2C+Microsoft%2C+Novell%2C+and+CompTIA+courses.+++I+have+seen+the+good%2C+the+bad%2C+and+the+ugly%2C+and+I+will+tell+all+in+this+talk.',NULL,NULL,5,583,'8LY04L00QR',NULL),
	(23,'JPEG+Steganography+Using+BPCS','Bit+Plane+Complexity+Segmentation+%28BPCS%29+steganography+is+a+technique+to+hide+data+inside+an+image+file.+Traditional+techniques++have+limited++information+hiding+capacity.+This+paper+describes%2C+analyzes+and+implements+a+steganographic+technique+that+embeds+a+payload+into+a+lossy+format+JPEG+using+BPCS+technique.+This+technique+takes+advantage+of+the+human+eye+limitation+where+a+human+cannot+identify+any+information+in+a+very+complicated+binary+pattern.+The+main+principle+of+BPCS+technique+is+that+the+bit+planes+of+the+binary+image+are+divided+into+the+informative+region+and+the+noise-like+region.+The+noise-like+regions+in+the+bit+planes+of+the+vessel+image+can+then+be+replaced+with+secret+data+without+affecting+the+image+quality.+The+secret+data+is+hidden+into+noise-like+region+of+the+cover+or+vessel+image+without+any+distortion+to+the+vessel+image.+',NULL,'Accepted as a Poster',7,596,'ZE2APPHZ3F','Accepted as a Poster'),
	(24,'Factorization+Using+Quantum+Computing','Present+methods+of+asymmetric+%28public+key%29%0Aencryption+rely+on+the+difficult+nature+of+cracking+their%0Aencryption+algorithms+due+to+the+mathematical%0Aproperties+that+they+employ.+These+encryption%0Aalgorithms+take+advantage+of+using+very+large%0Asemiprime+integers+to+encode+information.+The%0Aprocess+of+cracking+an+encrypted+message+boils%0Adown+to+the+ability+of+a+program+to+find+the+factors+of%0Athese+large+semiprime+integers.+Traditional+computing%0Ais+capable+of+such+a+feat%2C+but+the+time+it+takes+to%0Acompute+the+correct+factors+far+exceeds+the+time%0Aduring+which+the+encrypted+information+is+of+value.+A%0Apossible+solution+lies+in+the+power+of+quantum%0Acomputing+to+crack+encryption+within+useable+time%0Aframes.%0AThis+project+investigated+and+then%0Aimplemented+semiprime+factoring+algorithms+that+we%0Aran%2C+first+on+quantum+computer+simulators%2C+and+then%0Aon+real+quantum+computers.+We+report+our%0Aexperiences+and+results+and+discuss+the+future+for%0Apublic+key+encryption.',NULL,'Rejected',1,598,'J52OO0RUEJ','Rejected'),
	(25,NULL,NULL,NULL,NULL,5,600,'9IOV46UKZH',NULL),
	(26,'Instruction+Recall+Under+Stress','Exams%2C+presentations%2C+and+deadlines+are+all+classroom+activities+that+can+cause+extreme+stress+in+some+students.+This+stress+can+make+the+simplest+recall+difficult+and+some+students+panic.++Can+reducing+the+number+of+instructions+help+ease+the+stress%3F+Does+the+number+of+instructions+given+at+a+time%2C+matter%3F+In+this+paper%2C+we+describe+an+experiment+to+demonstrate+the+effects+of+stress+on+memory+recall.+The+experiment+is+to+highlight+the+difficulties+students+can+have+recalling+numerous+directions+after+getting+a+series+of+instructions+under+stress+and+in+a+controlled+environment.+While+the+hypothesis+resulted+in+an+inverse+relationship+in+stress+and+finish+time%2C+it+did+have+a+noteworthy+outcome+in+females+versus+male+performance+under+stress.',NULL,'Accepted',4,563,'6285X465PC','Accepted'),
	(27,'Combining+Block-Based+Programming+and+Hardware+Prototyping+to+Foster+Computational+Thinking','The+promotion+of+Computational+Thinking+principles+at+different+levels+of+education+enables+the+development+of+practical+competences+for+software+development.+A+number+of+off-+the-shelf+technologies+exist+to+promote+computational+abilities+with+the+support+of+block-based+programming+and+working+hardware.+However%2C+in+several+contexts+an+important+limitation+is+the+complexity+and+costs+that+carry+the+acquisition+and+implementation+of+working+hardware+such+as+Educational+Robots.+In+this+paper%2C+we+discuss+a+strategy+to+reinforce+the+acquisition+of+Computational+Thinking+%28CT%29+skills+by+providing+an+analogous+method+to+Educational+Robots.+We+offer+an+affordable+solution+to+assist+high+school+students+to+build+a+CT-based+software%2Fhardware+integrated+solution.+We+executed+this+strategy+in+a+coding+bootcamp+where+students+were+required+to+design+and+implement+an+algorithm%2C+and+illustrate+its+execution+in+software+and+hardware.+The+proposed+exercise+delivered+the+expected+results+engaging+students+to+abstract+the+solution+of+a+problem%2C+implement+an+algorithm%2C+and+create+a+physical+demonstration+of+it.',NULL,'Accepted',7,112,'ERXLPAUJQB','Accepted'),
	(28,'Classroom+Engagement+Activities+with+the+Raspberry+Pi','With+the+growing+number+of+cyber-attacks%2C+the+need+for+robust+cyber+security+education+has+never+been+greater.+With+numerous+universities+constructing+individual+cyber+security+curriculum%2C+it+is+imperative+to+establish+the+most+effective+means+of+teaching+cyber+security+in+a+productive+and+engaging+manner.+A+study+was+conducted+to+ascertain+whether+students+found+use+of+the+Raspberry+Pi+in+lab+activities+to+be+more+engaging+than+the+present+virtual+machine-based+labs.+The+study+is+a+first+step+in+assessing+whether+the+Raspberry+Pi+platform+should+be+adopted+and+incorporated+into+courses+across+the+cyber-curriculum+to+provide+students+with+a+more+hands+on+experience.',NULL,'Accepted as a Lightning Talk',1,605,'1VPLMAGAVZ','Accepted as a Lightning Talk'),
	(29,'The+Adventures+of+ScriptKitty%3A+Using+the+Raspberry+Pi+to+teach+adolescents+about+Internet+safety','Internet+safety+and+privacy+considerations+are+increasingly+important+topics+for+adolescents.+While+on-line+games+and+other+media+that+introduce+middle+school+and+high+school+students+to+security+and+privacy+concepts+exist%2C+there+are+very+few+practical+exercises+that+reinforce+concepts+in+a+hands-on+manner.+In+this+paper%2C+we+introduce+The+Adventures+of+ScriptKitty%2C+a+free+on-line+learning+aid+that+is+used+in+conjunction+with+the+Raspberry+Pi+single+board+computer.+We+pilot+The+Adventures+of+ScriptKitty+to+51+middle+school+and+high+school+students.+Our+results+showed+that+students+significantly+improved+their+understanding+of+basic+network+topics+and+felt+more+confident+on+how+to+stay+safe+on+the+Internet.',NULL,'Accepted',1,608,'NZ5VPLPKR8','Accepted'),
	(30,'Using+the+Raspberry+Pi+in+IT+Education','In+the+last+few+years%2C+the+emergence+of+cybersecurity+has+transformed+IT+education+forever.+The+biggest+issue+is+that+the+concept+of+cybersecurity+is+relatively+brand+new.+There+is+no+specific+way+to+educate+future+cybersecurity+graduates.+In+most+classes%2C+the+lack+of+hands+on+labs+means+that+students+are+unable+to+realize+the+importance+of+cybersecurity.+The+idea+to+use+the+Raspberry+Pi+to+create+a+smart+home+model+means+that+students+can+have+a+physical+device+to+penetration+test.+Virtual+labs+help+students+grasp+concepts%2C+but+do+not+teach+real+world+concepts.+%0A',NULL,'Accepted',4,564,'6YZ95VL07J','Accepted'),
	(31,'Hacking+the+Non-Technical+Brain%3A+Maximizing+Retention+in+a+Core+Introductory+IT+Course','Maximizing+student+retention+of%2C+and+ability+to+apply%2C+technical+material+in+introductory+information+technology+courses+is+a+complex+task%2C+especially+with+respect+to+the+general+student+population.+This+population+struggles+with+the+application+of+programming+concepts+in+the+time-constrained+testing+environment.+Our+study+considers+the+implementation+of+daily+quizzes+in+a+core-curriculum+information+technology+and+programming+course+as+a+means+to+improve+student+concept+retention+and+application.++Between+the+first+and+second+exams%2C+the+instructors+implemented+a+series+of+high-frequency%2C+no-risk+quizzes.+Of+the+four+sections+of+the+course+that+each+instructor+taught%2C+two+sections+each+were+provided+with+the+quizzes+as+the+experimental+group+and+two+remained+with+the+standard+curriculum+as+the+control.+The+results+demonstrate+the+benefits+of+frequent%2C+effortful+recall+on+student+performance+in+a+core-curriculum+information+technology+and+programming+course.',NULL,'Accepted',7,585,'F69D69ONO4','Accepted'),
	(32,'Modeling+School+Choice+of+STEM+Students+using+Decision+Tree','This+study+intends+to+determine+the+model+of+school+choice+of+science%2C+technology%2C+engineering%2C+and+mathematics+%28STEM%29+students+based+on+the+perceived+importance+of+accreditation+status+of+a+school%2C+field+of+study%2C+the+consideration+to+take+entrance+examinations%2C+and+confidence+towards+passing+an+entrance+examination.+Toward+this+goal%2C+208+students+answered+a+content-validated+research+instrument.+The+gathered+data+were+analyzed+using+data+mining+methods.+It+was+revealed+accreditation+is+important+since+it+strengthens+the+reputation+of+a+school.+Reputation+is+a+persistent+factor+in+choosing+a+school.+This+means+that+students+perceived+that+an+accredited+school+has+the+capacity+to+fulfill+its+goal+of+providing+quality+education.+Implications+to+research+and+practice+are+offered.',NULL,'Accepted as a Poster',7,340,'34E0BWZQ53','Accepted as a Poster'),
	(33,'Serverless+Distributed+Architecture+by+Incremental+Examples','Cloud+computing+has+the+potential+to+be+a+great+equalizer%2C+providing+powerful+and+sophisticated+computing+tools+to+anyone+with+an+internet+connection+and+even+a+minimal+budget.+In+fact%2C+educational+institutions+can+often+get+cloud+grants+providing+access+at+no+cost.+Although+any+traditional+computing+paradigm+can+be+implemented+with+cloud+computing%2C+there+are+now+new+and+potentially+more+useful+options+available.+This+workshop+is+a+hands-on+exploration+of+several+of+those+new+paradigms+in+a+single+gamifiable+system.%0A%0AParticipants+will+explore+cloud+computing+through+a+game-playing+case+study.+Concepts+covered+include+serverless+computing%2C+distributed+systems%2C+event-driven+software%2C+message+passing%2C+asynchronous+communication%2C+blob+stores%2C+and+non-relational+databases.+Each+new+idea+will+be+used+to+advance+the+example+system+a+step+at+a+time.%0A%0AThe+workshop+will+emphasize+ways+to+incorporate+the+case+study+in+class+and+possibilities+for+extending+it.+All+code+for+the+system+is+available+on+GitHub+for+participants+to+work+with+to+implement+their+own+games+or+extend+the+concepts+in+other+ways%2C+such+as+a+programming+assignment+submission+and+scoring+system.%0A',NULL,'Accepted',3,621,'588M90Y28K','Accepted'),
	(34,'CHEESE%3A+Cyber+Human+Ecosystem+of++Engaged+Security+Education','The+CHEESE+project+supplements+and+enhances+traditional+cybersecurity+education+with+hands-on%2C+practical+experience+in+common+cybersecurity+flaws+and+solutions.+CHEESE+requires+only+a+web+browser%2C+allowing+users+to+develop+cybersecurity+skills+without+compromising+their+own+computer+or+spending+hours+setting+up+a+complex+virtual+machine+%28VM%29+or+sandbox+environment.+In+this+tutorial+we+will+conduct+a+hands-on+walkthrough+of+a+couple+of+cybersecurity+demonstrations+on+CHEESE+and+present+an+overview+of+the+platform+and+the+community-driven+contribution+and+development+process.',NULL,'Accepted',3,77,'N7SRD3TRAI','Accepted'),
	(35,'The+Role+of+Multiple+Representations+and+Representational+Fluency+in+Cryptography+Education','Both+the+public+sector+and+private+sector+have+strong+demand+for+qualified+cybersecurity+professionals.+It+is+therefore+imperative+that+higher+education+institutions+can+fill+the+gap+by+producing+more+skilled+graduates+that+have+deep+understanding+of+cybersecurity.+Cryptography+is+one+of+those+fundamental+subjects+that+is+difficult+to+learn+and+error-prone+in+practice.+This+work+aims+to+understand+if+multiple+representations+and+representational+fluency+can+help+students+better+learn+new+cryptography+concepts.++Experiments+were+designed+to+present+the+same+new+cryptography+concepts+using+three+different+representations+to+the+participants%3A+language%2C+graph%2C+and+math+notations.+Assessments+with+different+representations+were+then+conducted+after+the+learning+phase+to+associate+the+learning+gains+to+the+learning+behaviors.+An+eye+tracker+was+used+during+the+learning+and+the+testing+phase+of+the+study+to+keep+track+of+the+learning+behaviors+of+the+participants%27.++This+IRB-approved+study+recruited+43+students.+Results+show+that+most+participants+prefer+the+language+representations%2C+but+other+two+representations+are+necessary+and+help+improving+the+comprehension+of+the+new+concepts.',NULL,'Accepted',7,77,'4CRWAG21XU','Accepted'),
	(36,'Human+Brain+Tumor+Detection+using+Anisotropic+Diffusion+Filtering+and+Segmentation+','Tumor+is+one+of+the+prime+reasons+for+causing+death+in+human+being%2C+which+can+be+detected+with+the+help+of+MRI.+In+this+paper%2C+we+tried+to+detect+whether+tumor+is+presented+or+not+using+MRI+images.+To+analyze+the+morphological+operation+on+MRI+images%3B+firstly%2C+the+image+is+filtered+using+Anisotropic+Diffusion+Filter%2C+to+reduce+the+contrast+between+pixels.+After+an+analysis+based+on+a+threshold+value%2C+the+image+is+resized+and+transformed+into+black+and+white+image.+This+is+the+primary+filter+used+to+locate+tumors.+Secondly%2C+the+image+morphological+operation+is+applied+to+solidity%2C+and+area+of+the+possible+location+achieved.+The+smallest+value+is+determined+from+the+statistical+average+of+different+MRI+image+which+contain+tumors.+Most+of+the+time%2C+this+simulation+can+give+correct+result+but+approximately+30%25+fails+to+detect+the+small+tumors.+To+solve+this+problem%2C+two-dimensional+MRI+images+taken+from+many+different+locations+on+particular+human+brain+and+to+do+analyse+brain+tumor+to+point+out+the+particular+three-dimensional+location.+To+accomplish+this%2C+two-dimensional+segmentation+and+tumor+detection+are+developed+for+a+better+efficiency+so+that+three-dimensional+detection+can+be+more+predictable.+The+image+segmentation+techniques+are+used+to+detect+the+object+by+using+dynamic+form.+The+object+area+and+its+shape+describe+the+snake+model+in+the+images.',NULL,'Rejected',7,637,'DXXPTVEM2G','Rejected'),
	(37,'Human+Tumor+Detection+Using+Active+Contour+and+Region+Growing+Segmentation','Segmentation+and+detection+of+borders+are+one+of+the+most+important+tasks+in+the+processing+of+images.+When+segmented%2C+an+image+is+divided+into+a+difficult+and+rapid+range+of+areas.+This+is+an+in-between+step+in+many+image+processing+programs%2C+such+as+content-+based+primarily+image+and+video+recovery%2C+object+detection+and+tracking%2C+biomedical+engineering+and+many+others.+The+segmentation+of+human+brain+tumors+from+magnetic+resonance+imaging+%28MRI%29+data+sets+is+of+first-rate+importance+for+progressed+analysis%2C+prediction+of+rate+increases+and+remedy-making+plans.+However%2C+automating+this+method+is+hard+because+of+the+existence+of+extreme+partial+quantity+effect+and+high-quality+variability+in+tumor+structures.+In+this+work%2C+we+introduced+area+developing+segmentation+and+active+contour+model+for+the+automatic+segmentation+of+the+human+brain+tumor+from+multimodal+volumetric+MRI+images.+Using+active+contour+and+region+growing+segmentation+we+progressed+the+accuracy+and+robustness+to+detect+more+than+one+brain+tumor.+With+the+accurate+place+and+shape+approximation+within+the+initial+degree%2C+the+item+is+effectively+detected+with+the+aid+of+using+active+contour.+The+correctness+and+robustness+of+the+proposed+algorithm+are+verified+on+extracting+the+tumor+areas+of+MRI.+In+comparison+with+the+tumor+outlines+defined+by+a+human+expert%2C+the+outlines+were+used+by+the+proposed+set+of+rules+to+achieve+sensitivity+values+of+up+to+98.98+percent.+The+proposed+algorithm+the+rules+presents+an+easy+and+accurate+approach+for+tumor+segmentation+in+MRI+images.',NULL,'Rejected',7,637,'NAXZC0VB45','Rejected'),
	(38,'Identifying+and+Evaluating+Information+Technology+Baccalaureate+Degree+Programs+per+IT2017','SIGITE+2012+included+a+report1+of+Information+Technology+%28IT%29%0Abachelor%E2%80%99s+degree+programs+in+the+USA+as+compared+to+the+IT2008%0AModel+Curriculum2.+New+IT+curriculum+guidelines+were+released+by+the%0AACM+in+late+20173.+This+paper+describes+the+process+for+identifying+and%0Aevaluating+IT+bachelor%E2%80%99s+programs+in+the+United+States+per+the+new+2017%0AIT+curriculum+guidelines.+Due+to+widespread+variation+in+the+names+of%0Aacademic+degree+programs%2C+one+cannot+simply+count+those+named%0A%E2%80%9CInformation+Technology.%E2%80%9D+This+research%2C+funded+by+SIGITE%2C+first%0Adefined+a+framework+for+evaluating+the+compliance+of+an+IT+program+to%0Athe+standard+of+the+IT2017+document.+This+framework+was+then+applied%0Athroughout+this+research.+We+first+compiled+a+list+of+prospective+IT%0Aprograms+to+research.+Each+institution+on+the+list+was+then+researched+by%0Alooking+at+their+webpage+in+search+of+a+list+of+computing+majors+listed+at%0Athat+institution.+If%2C+at+a+glance%2C+these+program%E2%80%99s+required+courses+looked%0Asimilar+to+those+required+in+an+IT+program%2C+the+program+was+evaluated%0Aand+given+a+numerical+compliance+factor.+This+compliance+factor+was%0Acalculated+using+the+assessment+form+that+is+included+in+this+document.%0AThe+results+of+this+analysis+are+presented.',NULL,'Accepted',7,2,'BFESK8QH4T','Accepted'),
	(39,'Complementing+Course+Contents+Between+IT%2FCS%3A+A+Case+Study+on+Database+Courses','Information+Technology+%28IT%29+and+Computer+Science+%28CS%29+are+two+well+regarded+computing+programs+that+produce+hundreds+of+thousands+of+graduates+in+each+year+to+meet+the+diverse+needs+in+the+IT+industry.+Despite+being+treated+as+two+distinct+disciplines%2C+IT+and+CS+do+share+commonalities+as+with+other+computing+disciplines+%28e.g.%2C+CE%2C+SE%2C+and+IS%29.+In+this+paper%2C+we+provide+a+detailed+analysis+on+the+commonalities+and+differences+between+IT+and+CS+along+with+their+respective+teaching+methodologies%2C+aiming+to+identify+opportunities+to+complement+these+two+computing+disciplines+so+that+they+can+benefit+from+each+other%27s+unique+advantages+to+better+train+future+computing+professionals.+A+case+study+on+the+database+courses+from+both+IT+and+CS+helps+reveal+deeper+insights+on+both+the+common+and+different+aspects+of+these+two+disciplines.+These+insights+are+then+leveraged+to+reach+important+recommendations+for+future+computing+curriculum+development.++',NULL,'Accepted',7,52,'Q39PSMMINW','Accepted'),
	(40,'Examining+Faculty+Perceptions+and+Approaches+to+Problem+Solving%2C+Reflective+Learning+and+Social+Learning+in+a+Computing+Education+Program%3A+An+Exploratory+Case+Study','This+exploratory+case+study+examined+problem+solving+approaches+across+three+computing+education+programs%3A+computer+science%2C+information+sciences+and+technologies+and+software+engineering.+Using+an+Experiential+Learning+Theory+framework%2C+faculty+perceptions+and+approaches+to+problem+solving+and+reflection+and+the+nature+of+social+learning+in+both+classroom+enactment+and+laboratory+sessions+for+second-year+undergraduate+students+were+examined.+Classroom+and+laboratory+observations%2C+in-depth+interviews+and+course+artifacts+served+as+the+main+sources+of+data.+Qualitative+data+analysis+revealed+three+key+findings%3A+a%29+faculty+perceptions+and+approaches+to+problem+solving+centered+on+modeling+problem+decomposition+to+break+down+larger+problems+into+smaller+steps+or+sub-problems%2C+b%29+reflection+was+informally+modeled+by+faculty+during+instruction%2C+but+primarily+occurred+internally+for+students+and+c%29+faculty+noted+the+importance+of+collaboration+in+the+workforce%2C+yet+perceived+collaborative+student+work+to+be+at+odds+with+developing+individual+skillsets%2C+leading+to+the+predominance+of+informal+rather+than+structured+social+learning.+These+findings+have+implications+for+faculty+understanding+of+computing+instruction+related+to+problem+solving%2C+intentional+strategies+that+promote+student+reflections+of+their+learning+process+and+importantly%2C+how+social+learning+is+conceptualized+and+enacted+in+computing.+In+addition%2C+the+study+also+had+implications+for+how+computing+faculty+are+currently+preparing+students+for+transition+to+workforce+demands.',NULL,'Accepted',7,172,'7QXLMSNLIS','Accepted'),
	(41,'Engaging+IT+Students+through+the+NASA+SUITS+Design+Challenge%3A+An+Experience+Report','Engaging+students+is+at+times+challenging%2C+especially+when+course+assignments+revolve+around+tedious+work+that+is+not+applicable+beyond+the+classroom.+One+way+to+prepare+students+who+are+about+to+graduate+is+the+capstone+course%2C+which+often+focuses+on+real-life+problems+that+require+a+solution.+This+paper+is+an+experience+report+of+the+integration+of+the+NASA+SUITS+%28Spacesuit+User+Interface+Technologies+for+Students%29+Design+Challenge+into+an+IT+capstone+course.+The+success+of+this+initiative+prompted+a+revision+of+projects+associated+with+several+prerequisite+courses%2C+with+the+aim+of+engaging+students+early+on+into+a+complex+project+that+spans+over+multiple+technological+domains.',NULL,'Accepted',1,37,'L8AQBQEGQ4','Accepted'),
	(42,'Modular+Tasks+Design+for+Teaching+Young+Students+on+Physical+Computing+Platforms','Physical+computing+has+gained+popularity+as+a+hands-on+approach+to+introduce+computing.+Young+students+can+create+tangible+computing+artifacts+that+connect+across+the+curriculum+subjects+on+a+wide+range+of+kid-friendly+devices.+However%2C+physical+computing+can+place+a+higher+demand+on+cognitive+capacity+than+traditional+screen-based+environments+since+learning+involves+the+more+complex+tasks+of+programming+and+constructing+hardware+components+and+circuits.+In+this+paper%2C+we+present+an+instructional+design+approach+to+address+the+challenges+of+teaching+physical+computing+for+middle+school+students.+A+hands-on+project+is+modularized+into+tasks+that+isolate+the+software+or+hardware+workloads.+The+tasks+are+then+optimized+into+a+sequence+to+minimize+context+switches+between+programming+and+hardware+construction.+Students%27+individual+progress+over+a+task+sequence+is+monitored+by+group+and+peer+checkpoints.+We+conducted+a+preliminary+study+among+three+random+groups+of+grade+5-7+students+working+on+activities+of+different+levels+of+hardware+complexity.+The+results+indicate+that+our+modular+approach+help+students+maintain+a+positive+attitude+and+persist+over+difficulties+while+learning+complex+physical+computing+tasks.+',NULL,'Accepted',7,138,'7D43CW66PD','Accepted'),
	(43,'Merging+Sustainability+and+Technology%3A+Building+an+Urban+Indoor+Farm','A+vast+majority+of+degrees+in+Information+Technology+are+somewhat+insular%2C+and+students+are+often+not+exposed+to+other+domains+that+may+benefit+from+concepts+such+as+automation.+During+the+Spring+2019+semester+we+created+a+joint+course+where+IT+students+worked+alongside+Environmental+Sustainability+majors+in+creating+an+urban+indoor+farm.+The+results+were+encouraging+and+support+future+interdisciplinary+collaborations.',NULL,'Accepted',5,37,'BFIYC590MR','Accepted'),
	(44,'Challenges+and+Approaches+to+Teaching+Big+Data+Technologies+in+an+Information+Technology+Program+with+Non-traditional+Students','Teaching+Data+Science+to+traditional+CS+majors+presents+many+challenges+to+students%2C+faculty+and+the+supporting+infrastructure.+When+the+student+population+changes+from+Computer+Science+students+to+those+in+an+Information+Technology+program+where+many+of+the+core+CS+courses+are+not+required%2C+additional+challenges+arise.+Couple+these+challenges+with+teaching+non-traditional+students+who+are+also+involved+with+their+families+and+careers%3B+the+difficulty+in+teaching+this+material+rises+exponentially.+For+this+experiment%2C+we+chose+to+use+Hadoop+to+teach+these+concepts.++We+will+discuss+our+recent+experience+teaching+Data+Science+to+Information+Technology+students+and+the+challenges+we+had+to+overcome.+',NULL,'Accepted as a Lightning Talk',7,575,'VRHOJIM01C','Accepted as a Lightning Talk'),
	(45,'On+Including+the+Institutional+Review+Board+Process+in+Undergraduate+Information+Technology+Curricula','This+lightning+talk+has+the+goal+of+discussing+the+relationship+between+the+institutional+review+board+%28IRB%29+and+the+Information+Technology+%28IT%29+education+community+by+analyzing+the+benefits+that+our+IT+students%2C+and+community+in+general%2C+can+receive+from+a+systematic+exposure+to+the+IRB+process.+Indeed%2C+while+in+the+last+decade+many+IT+faculty+members+have+successfully+conducted+research+complying+with+required+IRB+supervision+and+some+members+have+formally+or+informally+embedded+some+IRB+processes+in+their+courses%2C+a+general+idea+on+which+role+the+IRB+process+should+have+in+IT+curricula+and+what+might+be+the+pros+and+cons+of+%28at+least+partially%29+embedding+it+in+the+curriculum+and+specific+IT+courses+need+definition+and%2For+refinement.+',NULL,'Accepted',5,450,'B382N25RD7','Accepted'),
	(46,'Integrating+Data+Science+into+a+General+Education+Information+Technology+Course','The+National+Academies+recommend+academic+institutions+foster+a+basic+understanding+of+data+science+in+all+undergraduates.+However%2C+data+science+education+is+not+currently+a+graduation+requirement+at+most+colleges+and+universities.+As+a+result%2C+many+graduates+lack+even+basic+knowledge+of+data+science.+To+address+the+shortfall%2C+academic+institutions+should+incorporate+introductory+data+science+into+general+education+courses.%0A%0AA+general+education+IT+course+provides+a+unique+opportunity+to+integrate+data+science+education.+Modules+covering+databases%2C+spreadsheets%2C+and+presentation+software%2C+already+present+in+many+survey+IT+courses%2C+teach+concepts+and+skills+needed+for+data+science.+As+a+result%2C+a+survey+IT+course+can+provide+comprehensive+introductory+data+science+education+by+adding+a+data+science+module+focused+on+modeling+and+evaluation%2C+two+key+steps+in+the+data+science+process.+The+module+should+use+data+science+software+for+application%2C+avoiding+the+complexities+of+programming+and+advanced+math%2C+while+enabling+an+emphasis+on+conceptual+understanding.+We+implemented+a+course+built+around+these+ideas+and+found+that+the+course+helps+develop+data+savvy+in+students.',NULL,'Accepted',7,649,'MZASHAK78P','Accepted'),
	(47,'PROF%3A+An+Assistive+Tool+for+Educators+to+Semi-Autonomously+Create+Topic+Maps+and+Skill+Trees','Online+learning+environments+in+which+students+choose+specific+topics+they+study+are+becoming+increasingly+popular.+In+this+type+of+educational+environment+a+Topic+Map+%28TM%29%2C+which+provides+course+structure+by+linking+topics+to+content%2C+is+vital+in+guiding+users+on+their+educational+paths.+Creating+these+manually+is+time+consuming+and+requires+subject+matter+expertise+on+the+domain.+Some+research+has+previously+developed+tools+for+the+automatic+creation+of+TMs%2C+but+there+are+limitations+to+each+such+as+cost%2C+coupling+ability%2C+importation%2C+and+visualization+abilities.+Other+research+has+been+done+to+explore+the+impact+of+knowledge%2C+skills%2C+and+abilities+trees+%28KSAT%29+on+a+student%27s+learning+outcome+to+provide+specific+paths+students+can+follow+to+learn+a+specific+skillset.+Transitioning+from+unorganized+TMs+to+structured+KSATs+is+the+fundamental+methodology+educators+follow+to+develop+clear+learning+paths+and+education+assessments+for+students%3B+this+is+a+time+consuming+process.+This+paper+introduces+the+Pedagogical+Resource+Organization+Framework+%28PROF%29%2C+which+takes+content+from+a+current+course%2C+creates+a+TM%2C+then+transforms+this+TM+into+a+KSAT.+We+evaluated+PROF+against+a+graduate+level+course+and+compared+the+resulting+KSAT+to+a+manually+created+KSAT+for+the+same+course+to+measure+its+effectiveness.+The+results+showed+the+semi-automatic+creation+tool%2C+with+less+than+one+working+hour+subject+matter+expert+%28SME%29+input%2C+produced+a+TM+containing+over+36%25+exact+matches+and+over+93%25+adjusted+matches+to+the+SME-created+TM.+PROF+also+produced+a+KSAT+for+the+course+using+nodes+from+the+TM+for+educators+to+align+learning+objectives+with+course+readings.',NULL,'Accepted as a Lightning Talk',7,654,'ZCT4AZOEB1','Accepted as a Lightning Talk'),
	(48,'Enhancing+the+Program+Quality+and+College-Level+Success+Metrics+of+an+IT+Program+at+a+Large+Public+University','Student+success+is+a+widely+discussed+and+studied+topic+in+higher+education.+Colleges+and+universities+have+been+using+college-level+success+metrics+%28time+to+degree%2C+graduation%2C+and+retention+rates%29+to+measure+student+success.+There+are+multiple+factors+that+affect+student+success.+Our+previous+study+found+that+non-accredited+Information+Technology+%28IT%29+program+within+the+Department+of+Computer+Science+and+the+way+IT+and+Computer+Science+%28CS%29+programs+were+established+within+the+department+and+the+resulting+social+comparisons+were+one+among+many+factors+that+had+a+negative+consequence+on+IT+students%E2%80%99+success.+However%2C+the+IT+program+at+the+targeted+university+received+accreditation+from+the+Accreditation+Board+for+Engineering+and+Technology+%28ABET%29+in+2013%2C+and+since+then%2C+many+changes+were+made+in+the+program.+In+this+paper%2C+we+examine+student+data+from+IT+undergraduate+program+at+a+large+public+university+to+identify+who+started+the+program+in+Spring+2014+and+Fall+2014+semesters+and+dropped+out%2C+changed+their+major+or+successfully+completed+the+program+by+Fall+2017.+We+also+conducted+a+network+analysis+of+the+IT+program+curriculum+to+determine+courses+that+were+causing+difficulty+for+students+to+continue+in+the+program.+Our+results+suggest+that+there+is+no+significant+improvement+in+college-level+student+success+metrics+since+ABET+accreditation.+We+conclude+that+IT+programs+in+higher+education+institutions+need+to+take+additional+program+improvement+measures+that+are+student-centered+to+improve+students%E2%80%99+course+passing+rate.+Based+on+our+analyses%2C+we+propose+necessary+measures+to+improve+both+college-level+success+metrics+and+program+quality.',NULL,'Accepted',7,316,'TF2CNRBX2I','Accepted'),
	(49,'Using+Virtual+Machines+to+Enhance+the+Educational+Experience+in+an+Introductory+Computing+Course','This+paper+describes+and+evaluates+the+use+of+virtual+machines+%28VMs%29+in+an+introductory+computing+course+to+simplify+the+installation+of+required+software+and+reinforce+student+understanding+of+client-server+networks+and+applications.++The+impact+of+VMs+was+assessed+by+tracking+the+change+in+software+installation+and+troubleshooting+time+and+student+performance+across+two+academic+years+and+ten+classrooms.++The+results+indicate+that+the+use+of+VMs+improved+classroom+efficiency%2C+increased+instruction+time+previously+lost+to+software+installation%2C+and+sustained+or+improved+student+performance+on+critical+events.+Additionally%2C+the+students+had+greater+success+building+web+applications+on+the+VMs+that+both+they+and+their+instructors+could+view+both+source+code+and+the+running+application.',NULL,'Accepted',1,595,'YBP76UVHOV','Accepted'),
	(50,'Dropout+vs.+Time+to+Degree%3A+The+Existing+Tension+between+Retaining+and+Graduating+%E2%80%98At-Risk%E2%80%99+Students+in+a+Timely+Manner+','Students%E2%80%99+dropout+and+delayed+graduation+have+been+serious+issues+in+higher+education.+Especially%2C+the+dropout+rates+are+high%2C+and+time-to-graduation+is+longer+than+usual+in+computing+programs.+Higher+education+institutions+are+under+pressure+to+retain+at-risk+students+and+helping+them+to+graduate+in+a+timely+manner.+In+this+work%2C+we+show+the+need+for+flexibility+in+terms+of+recommending+courses+and+offering+additional+classes+%28or+sessions%29+to+retain+and+graduate+at-risk+students.',NULL,'Accepted',4,316,'EEI0BSIW4Y','Accepted'),
	(51,'Project+Design+and+Implementation+for+Digital+Forensics+Education','As+with+other+disciplines+in+cybersecurity%2C+hands-on+activities+are+an+important+component+in+digital+forensics+education+to+help+students+gain+better+understanding+of+basic+concepts+and+knowledge+presented+in+class+lectures.+While+these+lab+activities+are+helpful+for+students+to+learn+how+to+use+software+and+hardware+forensic+tools%2C+it+is+hard+to+help+students+gain+problem-solving+and+analytic+skills+and+other+experiences+that+are+needed+to+conduct+digital+forensic+investigation+in+real-world.%0A%0AIn+our+digital+forensics+courses%2C+we+have+been+using+course+projects+as+a+means+to+help+students+develop+their+skills+for+identifying%2C+locating%2C+preserving%2C+recovering%2C+examining%2C+analyzing+and+presenting+electronic+evidence+associated+with+a+case+of+digital+forensic+investigation.+Student%27s+feedback+is+positive+and+the+educational+outcome+is+promising.+In+this+paper%2C+we+present+the+idea+to+design+and+implement+a+course+project+to+achieve+associated+educational+objectives+for+a+digital+forensics+course.+Example+projects+finished+by+students+are+introduced+to+show+the+major+activities+to+complete+a+project.+Experience%2C+lessons+and+feedback+from+students+are+discussed.+Our+results+will+provide+a+point+of+reference+for+those+who+teach+a+digital+forensics+course+at+a+college+or+university%2C+or+are+developing+a+digital+forensic+curriculum.',NULL,'Accepted',1,638,'B2DOZ4PQQY','Accepted'),
	(52,'Practice+What+You+Preach+-+Building+a+Capstone+Management+System+as+Undergraduate+IT+Capstone+Projects','While+a+capstone+experience+is+an+important+part+of+the+IT+curriculum%2C+effectively+managing+a+large+number+of+student+projects+can+be+a+challenging+task+for+a+capstone+instructor.+This+paper+describes+the+authors%E2%80%99+approach+in+building+a+capstone+management+system+%28CMS%29+as+a+list+of+software+development+projects+for+an+undergraduate+capstone+class.+The+authors+present+their+experiences+in+all+aspects+of+system+development+life+cycle+such+as+planning%2C+analysis%2C+design%2C+implementation%2C+as+well+as+project+management+and+student+team+dynamics.+The+lessons+learned+from+this+endeavor+may+inspire+other+capstone+instructors+in+the+IT+field+or+the+general+computing+disciplines+to+build+similar+systems+to+manage+their+capstone+projects+while+avoiding+some+of+the+pitfalls+that+the+authors+encountered.',NULL,'Accepted',1,550,'F39VGXIW2C','Accepted'),
	(53,'Proposal+and+Evaluation+of+a+Security+Incident+Response+Training+Method+using+Programming','We+propose+a+security+incident+response+training+method+using+programming+contents.+This+training+program+aims+to+recognize+participant+importance+of+dealing+with+problems+calmly+and+preparing+for+various+kinds+of+security+incidents+and+cyber-attacks.+We+actually+conduct+this+training+program+with+questionnaires+and+analyze+its+result.%0ANowadays%2C+there+are+various+cyber-attacks+in+the+world.+In+terms+of+dealing+with+cyber+incident%2C+growing+not+only+technical+skills+of+cyber+security+but+also+non-technical+skills+are+also+important+factors.+As+some+way+of+training+non-technical+skills%2C+training%2C+Table+Top+Exercises+and+testing+are+available.+But+existing+approach+needs+some+funds%2C+times+and+trainers+who+conduct+these+training+more+smoothly.+Final+objective+of+this+research+is+to+solve+these+problems+without+reducing+learning+efficiency.',NULL,'Accepted as a Poster',7,646,'R5LHIMPYJ0','Accepted as a Poster'),
	(54,'Tips+for+Using+Open+Educational+Resources+to+Reduce+Textbook+Costs+in+IT+Courses','In+this+paper%2C+we+describe+tips+for+employing+open+educational+resources+%28OERs%29+to+reduce+and+most+often+eliminate+textbook+costs+in+IT+courses.++These+techniques+and+resources+have+been+mined+from+our+fifteen+years+of+experience+of+including+OERs+in+our+IT+online+and+face-to-face+courses+at+both+the+undergraduate+and+graduate+level.+In+addition+to+describing+them%2C+we+provide+our+outcomes+and+implementation+advice+for+OERs.+',NULL,'Accepted as a Lightning Talk',1,450,'X72NYAG8NN','Accepted as a Lightning Talk'),
	(55,'Development+of+a+Configuration+Management+Course+for+Operations+Students','ABSTRACT%3A+%0AThe+Operations+side+of+deploying+a+modern+computing+application+necessarily+involves+multiple+groups+working+in+concert+to+develop+the+application+and+the+server+side+configuration+that+will+support+that+application.++This+paper+reports+on+efforts+to+develop+a+course+that+encourages+students+to+dig+into+issues+related+to+configuration+management%2C+security+policy+development%2C+application+auditing%2C+business+control+issues%2C+and+most+importantly%2C+team+work.++While+the+course+is+entitled+%E2%80%9CConfiguration+Management%E2%80%9D+it+is+much+more+about+students+creating+a+process+for+secure+iterative+application+deployment+that+borrows+extensively+from+the+DevOps+movement.%0A%0AAnsible%2C+our+chosen+configuration+management+tool%2C+is+relatively+easy+to+work+with+at+the+level+of+complexity+that+can+be+reached+in+an+undergraduate+class.++What+made+this+class+different+was+the+attempt+made+to+create+a+process+that+would+more+closely+mimic+the+Operations+side+of+a+DevOps+workflow.++Initial+results+from+the+class+were+encouraging+and+many+lessons+were+learned.%0A',NULL,'Accepted as a Lightning Talk',1,666,'LFFI602IAL','Accepted as a Lightning Talk'),
	(56,'MySecurityLab%3A+A+Tool+for+Teaching+and+Learning+Quantitative+Assessments+of+Security+Risks++','Cybersecurity+and+information+technology+students+need+to+learn+the+formal+models+and+methods+of+security+risk+assessments.+++What+are+the+principles+of+security+risk+assessments%3F+How+is+the+national+standard+of+security+risk+assessment+and+compliance+defined%3F+What+set+of+security+risk+assessment+should+student+learn+and+how%3F+What+kinds+of+case-based+projects+should+be+designed+to+promote+learning+of+security+risk+assessment+skills%3F+This+enlightening+talk+discusses+these+and+other+questions.+The+presentation+provides+a+demonstration+of+practical+hands-on+case-based+projects+for+teaching+and+learning+security+risk+assessments.+',NULL,'Accepted',5,159,'EMEW3MWGUN','Accepted'),
	(57,'Teamwork+online%3A++Learning+from+the+experience','The+ability+to+work+in+teams+is+valued+in+the+real+world%2C+and+we+reflect+that+in+the+emphasis+on+teamwork+skills+in+our+curriculum.+This+paper+will+explore+how+reflection+on+their+own+team+experiences+can+enhance+their+future+skills+in+teamwork.+',NULL,'Accepted',5,154,'1Y6V448DRI','Accepted'),
	(58,'Integrating+Blockchain+Technology+into+Healthcare','Blockchain+technique+acts+like+fundamental+for+an+internet+peer-to-peer+network+based+on+exchanges+and+transactions.+It+uses+cryptography+to+facilitate+exchange+and+transaction+of+values+and+goods+over+the+network.+Healthcare+is+a+progressive+industry+in+the+US%2C+the+government+has+forced+the+healthcare+providers%2C+insurance+companies+to+utilize+the+system+developed+by+the+rules.+Blockchain+owns+functionalities+like+immutability%2C+decentralization%2C+and+transparency.+Healthcare+industry+includes+issues+which+can+be+addressed+to+if+the+integration+of+blockchain+is+implemented.+The+implementation+of+the+Health+Insurance+Portability+and+Accountability+Act+%28HIPPA%29+in+1996+made+difficult+for+software+vendors+to+manage+the+documents+and+records+of+the+patients.+This+paper+tied+to+utilize+the+blockchain+techniques+into+the+healthcare+industry+to+keep+all+the+records+and+transaction+safe%2C+secure+and+reducing+user+data+breaches.+The+project+focuses+on+these+issues+of+the+healthcare+and+insurance+industry.+We+implemented+the+Ethereum+Smart+Contract%2C+an+extended+part+of+the+blockchain+to+provide+a+profitable+and+gainful+solution.++',NULL,'Rejected',7,405,'DAB4EA7SP9','Rejected'),
	(59,'Data+Analytics+in+Google+Mobile+Education+Apps','The+impact+of+mobile+network+has+created+its+great+impact+on+today%E2%80%99s+generation%2C+from+smart+phones+to+online+education.+It+is+termed+as+a+means+of+information+and+knowledge+for+today%E2%80%99s+youth.+Education%2C+as+the+foundation+of+most+of+all+the+changes+in+this+century%2C+involves+development+and+changes.+With+all+the+help+from+the+traditional+education+channels%2C+the+new+generation+also+attempts+many+innovative+ways+to+utilize+the+technologies+for+education%3A+online+and+mobile+education.+Schools+and+colleges+have+started+providing+education+using+mobile+ways.+This+brings+teachers+and+students+to+share+knowledge+and+learn+using+the+same+platform+in+innovative+ways.+Leading+software+providers+like+Google%2C+Apple%2C+and+Microsoft+have+introduced+various+Education+oriented+applications.+In+this+paper%2C+we+utilize+a+data+analytic+method+to+study+the+development+and+the+trend+of+one+of+the+largest+mobile+apps+market+%E2%80%93+Google+Play%2C+offered+by+Google+in+the+education+app+category.+With+different+data+mining+and+text+analysis+methods%2C+we+reported+our+study+results+of+this+analysis%2C+and+hopefully+to+provide+some+reference+for+the+mobile+education+market+from+this+analytics+window.++',NULL,'Rejected',5,405,'4SZHTYFOO2','Rejected'),
	(60,'Are+We+Ready+for+a+VR+Classroom%3F+A+Review+of+Current+Designs+and+a+Vision+of+Future+Virtual+Reality+Classrooms','With+the+advance+of+head-mounted+virtual+reality+technology+and+their+lower+cost%2C+it+is+foreseeable+that+an+online+course+can+be+delivered+in+a+virtual+reality+%28VR%29+classroom.+This+paper+introduces+head-mounted+VR+technology%2C+discusses+the+current+designs+of+VR+applications%2C+and+depicts+a+vision+of+future+VR+classrooms.',NULL,'Accepted',5,233,'2THVE8I4SZ','Accepted'),
	(61,'Untampered+Electronic+Voting+in+Entertainment+Industry%3A+a+Blockchain-based+Implementation','Digital+services+are+gaining+new+meaning+with+the+invention+of+Blockchain+technology.+While+Blockchain+still+has+a+long+way+to+go%2C+it+has+gained+great+expertise+in+the+technical+and+legal+aspect+of+the+digital+services.+Digital+services+work+well+in+terms+of+functionality+without+the+involvement+of+Blockchain%2C+but+there+is+always+a+risk+of+privacy+and+security+which+mostly+remains+unanswered.+Technologies+leveraged+through+Blockchain+system+are+secure+as+well+as+maintain+anonymity+of+all+the+members+involved.+In+this+paper%2C+we+are+leveraging+a+blockchain+based+system+to+implement+a+new+electronic+voting+system+to+cast%2C+transport+and+count+votes+for+singing+competitions+held+on+national+televisions.+The+chance+of+having+a+fair+and+transparent+voting+system+increases+with+the+involvement+of+Blockchain+based+electronic+voting+services.+The+number+of+voters+also+increases+due+to+having+a+chance+to+experience+a+transparent+system.+',NULL,'Submitted',7,405,'BM2WYGCNN4','Accepted as a Poster'),
	(62,'Data-driven+Analytics%3A+A+Case+Study+of+Education+Branding','The+size+of+data+over+the+Internet+is+humongous+and+at+the+same+time+wide+spread.+Information+concerning+any+topic+in+the+world+is+just+a+click+away+with+the+invention+of+the+Internet+and+the+various+applications+hosted+over+it.+In+this+paper%2C+we+reported+our+study+on+two+major+target+channels+for+fetching+information+are+social+media+and+search+engine.+Social+media+has+thrived+with+the+invention+of+umpteen+number+of+applications+such+as+Facebook%2C+Instagram%2C+Snapchat%2C+and%2C+Myspace%2C+etc.+At+the+initial+stage%2C+social+media+was+mostly+conceptualized+as+a+mode+of+entertainment+but+with+the+growth+of+the+technological+industry%2C+the+features+provided+by+social+media+are+endless.+In+this+study%2C+we+focus+on+Instagram+one+of+the+leading+social+media+application+popularly+termed+as+a+photo+sharing+application+but+is+capable+of+doing+much+more+than+that.+Google+search+engine+enables+the+user+to+research+and+finds+data+from+the+comfort+of+their+home%2C+Google+Trends+is+the+leading+analytical+browser+launched+by+google+to+keep+track+of+the+search+results+and+notify+about+the+latest+trends+to+the+marketers.+Through+this+case+study%2C+we+leverage+the+data+results+gathered+from+Instagram+and+Google+Trends+to+understand+the+latest+branding+technique+popular+in+the+market.+The+trend+of+branding+was+initiated+with+the+invention+of+these+platforms.+There+are+various+types+of+brandings+introduced+every+month+like+retail+branding%2C+fashion+branding%2C+and%2C+fitness+branding%2C+etc.+In+this+case+study%2C+we+comprehensively+leverage+the+social+media+and+search+engine+for+social+analytics.+We+bring+a+case+study+in+Education+Branding+to+provide+insight+for+social+analytics+as+well+as+the+education+institution+and+organizations.',NULL,'Rejected',5,405,'MH8R5RP0D1','Rejected'),
	(63,'Modeling+Filipino+Academic+Affect+during+Online+Examination+using+Machine+Learning','The+learning+environment+comprised+of+emotional+and+cognitive+activities.++Literature+and+practice+support+that+there+is+a+need+to+incorporate+the+measurement+of+student+affect+during+the+learning+assessment+to+identify+student+engagement.+The+learning+engagement+in+most+studies+is+focused+on+identifying+learner+affect+during+class+discussion+and+content+delivery.+This+study+measured+academic+affect+during+assessment+and+developed+an+online+examination+multi-modal+academic+affect+model.++The+multi-modal+affect+model+referred+to+the+students%27+facial+expressions+and+head+pose+gestures+as+they+took+and+answered+the+online+exam.++Using+thematic+analysis+and+expert+opinion%2C+the+study+generated+the+presence+of+the+following+academic+affect%3A+relaxed%2C+curious%2C+bored%2C+frustrated%2C+and+distracted.+The+academic+affect+were+correctly+annotated+with+a+computed+interrater+kappa+value+of+0.62.+Annotation+by+the+coders+was+mapped+with+the+features+extracted+from+a+behavior+analysis+toolkit+that+produced+the+Filipino+Online+Examination+Multi-Modal+Affect+Dataset.++The+model+yielded+an+accuracy+of+92.66%25',NULL,'Accepted as a Poster',7,617,'Q5OIQ1T1G0','Accepted as a Poster'),
	(64,'Panel%3A+Transfer+Students','Many+students+transfer+into+BSIT+degree+programs+either+from+community+colleges+or+from+other+4-year+institutions.++These+students+have+more+varied+academic+background+and+work+experience+and+this+creates+different+considerations+for+their+academic+programs.+This+panel+will+address+issues+and+challenges+related+to+ensuring+success+of+transfer+students+in+undergraduate+Information+Technology+programs.',NULL,'Accepted',2,365,'ZDAVE9MOGQ','Accepted'),
	(65,'Case+Study%3A+The+evolution+of+an+IT+Program+in+a+Research+University','This+paper+describes+the+journey+of+an+IT+program+in+a+mid-west+large+research+university+%2844%2C000%2B+students%29.+For+the+past+seventeen+year%2C+the+program+grew+from+nonexistence+to+the+largest+computing+program+on+campus+and+the+seventh+largest+overall.+The+undergraduate+program+evolved+into+an+academic+unit+that+later+added+a+Master%E2%80%99s+program+and+most+recently+a+PhD+program+in+Information+Technology.+The+paper+documents+the+evolution+as+a+case+study+on+IT+program+implementation%2C+accreditation%2C+ranking%2C+keeping+up+with+the+evolving+IT+landscape%2C+developing+graduate+programs+in+IT%2C+articulating+the+role+of+the+IT+discipline+to+stakeholders%2C+defining+the+IT+research+space%2C+managing+change%2C+and+securing+internal+and+external+funding.+In+addition%2C+the+paper+will+describe+key+initiatives+that+are+now+positioning+the+program+to+regional%2C+state%2C+a+possibly+national+leadership.+Finally%2C+the+paper+provides+lessons+learned%2C+strategies%2C+and+recommendations.',NULL,'Accepted',1,688,'1MP0HAPP7G','Accepted'),
	(66,'Adapting+the+IT2017+Curricula+for+Two-Year+Transfer+Programs%3A+Determining+the+Optimal+Level+of+Curricular+Guidance','Effective+coordination+between+IT+transfer+programs+at+two-year+colleges+and+four-year+transfer+institutions+is+desirable+to+minimize+repetition+of+content+coverage+and+to+allow+two-year+programs+to+properly+prepare+their+students+for+transfer+while+having+them+achieve+some+of+the+IT2017+competencies.+Curriculum+guidance+for+two-year+IT+Transfer+programs+needs+to+accommodate+a+variety+of+local+requirements+while+also+giving+two-year+programs+the+flexibility+to+effectively+collaborate+with+their+four-year+transfer+partners.+The+ACM+CCECC+and+its+IT+Transfer+Task+Force+%28ITTTF%29+are+creating+Information+Technology+Transfer+Curricula+2019+guidance+%28IT+Transfer%29+for+two-year+transfer+programs%2C+and+their+work+would+benefit+from+further+IT+community+input+on+the+classification+of+essential+and+supplemental+competencies%2C+and+on+the+impact+of+the+guidance+document%E2%80%99s+degree+of+flexibility+on+the+IT+discipline+as+a+whole.',NULL,'Accepted',2,689,'UPSZRC62AY','Accepted'),
	(67,'The+Effects+of+Surface+Diversity+Compared+to+Deep+Level+Diversity','Diversity%E2%80%99s+contribution+to+performance+in+generating+unique+ideas+is+difficult+to+parse+out.+This+is+due+to+the+difficulty+associated+with+separating+deep-level+diversity+from+surface-level+diversity.+The+purpose+of+this+study+is+to+use+virtual+models+and+voice+modulation+to+disguise+surface-level+diversity+and+see+if+deep-level+diversity+still+impacts+generation+of+ideas.+',NULL,'Accepted',4,691,'QZ3NB735KR','Accepted'),
	(68,'Improving+the+Cybersecurity+and+Information+Assurance+Pipeline%3A+Impact+of+High+School+After-School+Program','Over+a+two+year+period%2C+Some+College+faculty+participated+in+an%0ANSF+funded+grant+to+extend+the+cybersecurity+pipeline+%5B1%5D+into+the%0Ahigh+schools+by+delivering+cybersecurity+concepts+in+an+after+school%0Aprogram+where+students+to+earn+college+credit.+This+poster+explores%0Athe+profile+of+incoming+students+and+the+impact+of+the+program.',NULL,'Accepted',4,247,'9ZIV1J9BP9','Accepted'),
	(69,'Tempting+High+School+Students+into+Cybersecurity+with+a+Slice+of+Raspberry+Pi','Improving+the+Pipeline+is+an+NSF+grant+project+to+extend+the+Information+Assurance+and+Cybersecurity+pipeline+into+the+high+school+environment+by+offering+an+after-school+for+college+credit+course+to+students.++This+paper+discusses+the+use+of+an+isolated+and+portable+Raspberry+Pi+network+within+the+course.',NULL,'Accepted as a Lightning Talk',1,247,'R6QEITUO0N','Accepted as a Lightning Talk'),
	(70,'Wordy%3A+Interactive+Word+Cloud+to+Summarize+and+Browse+Online+Videos+for+eLearning','In+this+paper%2C+we+describe+our+Wordy+system%2C+which+creates+a+word+cloud+based+on+video+content+and+allows+users+to+summarize+and+search+for+video+content+using+the+word+cloud.+We+focus+on+lecture+videos%3A+converting+speech+information+from+the+videos+into+text%2C+extracting+keywords+from+videos+through+morphological+analysis%2C+and+creating+a+word+cloud+comprised+of+those+keywords.+In+addition%2C+the+keywords+in+the+word+cloud+are+selectable.+When+a+user+selects+a+keyword%2C+the+system+will+find+several+points+of+the+video+in+which+a+teacher+talks+about+the+keyword%3B+the+system+then+generates+a+relevant+list+of+thumbnails.+In+order+to+save+time+for+the+user%2C+the+system+offers+a+digest+playback+mode+that+consecutively+browses+the+scenes+concerned+with+the+keywords.+Herein%2C+we+describe+our+concept+and+the+implementation+of+the+prototype+system.++',NULL,'Accepted as a Lightning Talk',7,692,'T3H3W2NZBP','Accepted as a Lightning Talk'),
	(71,'Blending+robotics%2C+curricular+activities%2C+and+software+engineering+principles+in+middle+schools','K-12+education+aims+at+preparing+students+for+the+current+labor+market%2C+where+a+large+number+of+people+engage+in+programming+activities%2C+even+without+being+trained+developers.+Fostering+Software+Engineering+%28SE%29+principles+in+K-12+can+increase+the+quality+of+the+code+that+students+will+write+in+their+future+career.+In+middle+schools%2C+Computer+Science+%28CS%29+is+usually+taught+as+part+of+other+disciplines%2C+thus+the+challenge+is+fostering+SE+principles+while+guaranteeing+the+achievement+of+the+existing+curricular+learning+objectives.+We+describe+a+didactic+module+and+an+assessment+framework+to+this+purpose%2C+and+report+the+results+of+a+classroom+experience+%28involving+11+middle+school+first-year+students%29+that+show+the+effectiveness+of+the+proposed+approach.+These+results+encourage+us+to+work+on+the+development+of+the+next+modules+in+the+progression+dedicated+to+middle+schools%2C+and+to+perform+new+experiments+to+check+if+these+modules+support+students+towards+the+achievement+of+the+middle+school+final+objectives.',NULL,'Accepted as a Poster',7,112,'54N097RM29','Accepted as a Poster'),
	(72,'IT+meets+CS%3A+An+international+comparison+of++++++curricula','It+is+recognized+that+Information+Technology+%28IT%29+requires+many+competencies+covering+a+wide+range+of+domains+exhibiting+an+impressive+changing+rate.+The+paper+report+an+experience+that+by+leveraging+on+mandatory+curricula+in+England%2C+national+guidelines+in+Italy%2C+frameworks+from+ACM+and+Computer+Science+Teacher+association+and+CISCO+professional+curricula%2C+propose+a+learning+trajectory+%28LT%29+aiming+at+developing+competencies+in++Database%2C+Web+development%2C+Human-Computer+Interfaces%2C+networking%2C+cybersecurity+and+Project+Management+that+leveraging+on+an+emphasis+in+design+tools+have+the+flexibility+to+adapt+to+the+fast+content+change.+Indication+of+minimum%2C+advanced+and+elective+competencies+allows+serving+students+with+different+needs.+Interdisciplinary+projects+experiences+and+various+progression+paths+allow+the+LT+trajectory+to+be+used+for+pre-service+formation+and+in-service+teacher+professional+development+and+for+undergraduate+studies.+The+main+lesson+learned+from+those+experiences+will+be+discussed.',NULL,NULL,1,661,'5WMR86M3HW',NULL),
	(73,'Resources+for+Improving+the+Cybersecurity+Pipeline','Improving+the+Pipeline+is+a+capacity-building+NSF+funded+project%0Ato+increase+the+number+of+Information+Assurance+and+Cyber+Defense%0A%28IA%2FCD%29+professionals.+The+project+developed+course+materials%0Afor+an+after-school+for+college+credit+program+for+high+school+students.%0ACourse+materials+created+for+this+grant+are+freely+available%0Afor+download.+This+paper+discusses+how+to+access+the+materials.',NULL,'Accepted',5,247,'CIAO9I2R69','Accepted'),
	(75,'How+Selective+True-False+Questions+Reward+Student+Recognition','True+and+False+%28T%2FF%29+questions+seldom+undergo+research+in+computer+science+education%3B+hence%2C+there+exists+little+to+document+improvements+to+T%2FF+questions+in+CSE.+We+analyze+the+effects+of+Selective+True+and+False+%28STF%29+questions.+In+STF%2C+the+student+answers+a+subset+of+the+question+pool%2C+rather+than+answering+all+of+it.+Students+choose+questions+they+believe+they+can+answer%2C+and+avoid+questions+which+they+deem+difficult.+Therefore%2C+an+intelligent+selection+of+questions+leads+to+a+lower+probability+of+guessing.+This+in+turn+rewards+students+with+knowledge+%28as+it+allows+them+to+recognize+easier%2Fharder+problems%29+while+remaining+indifferent+to+students+with+total+ignorance.+In+other+words%2C+STF+lessens+the+probability+of+a+weaker+student+achieving+a+higher+grade+than+a+stronger+student+via+guessing.+Our+data+suggests+that+stronger+students+are+able+to+recognize+and+answer+questions+with+success+%28achieve+a+score+in+the+top+half+of+the+class%29.+Explicitly%2C+the+number+of+times+a+question+is+selected+versus+student+success+among+students+which+selected+that+question+has+a+correlation+of+0.73.+Furthermore%2C+examining+the+success+of+the+student%27s+particular+set+of+selected+questions+rather+than+the+success+of+the+student+themselves%2C+one+finds+an+even+stronger+correlation+versus+the+number+of+times+a+question+is+selected%2C+i.e.+a+correlation+of+0.99.',NULL,'Accepted as a Lightning Talk',7,618,'ONKU00BBGC','Accepted as a Lightning Talk'),
	(76,'Technology+Acceptance+Model+Revisited+--Toward+a+Framework+of+Integrated+Information+Technology+Evaluation+Model','With+the+explosion+of+information+technology+%28IT%29+and+IT+business+in+the+last+few+decades%2C+it+is+more+and+more+complex+and+complicated+for+IT+management+staff+to+choose+a+right+solution+to+meet+the+computing+need+of+an+organization.+There+could+be+multiple+technical+solutions+for+a+single+demand+and+a+number+of+different+IT+products+for+each+solution.+It+is+usually+a+big+burden+for+an+IT+group+to+assess+and+compare+them+quantitatively+and+comprehensively+to+make+the+decision+on+which+one+is+a+better+fit.+This+is+because+multiple+factors+will+affect+the+actual+adoption+of+an+information+technology+or+IT+product.+In+addition%2C+it+is+hard+to+find+a+commonly+accepted+guideline+to+carry+out+such+an+assessment.+Furthermore%2C+this+circumstance+brings+a+challenge+for+educators+who+teach+IT+management.+It+is+not+quite+clear+about+the+general+guideline+for+assessing+information+technology+and+IT+product+quantitatively+and+comprehensively.%0A%0AWe+propose+a+framework+of+an+integrated+model+that+can+be+used+to+comprehensively+and+quantitatively+assess+and+compare+IT+products%2C+information+technologies+and+IT+solutions.+We+assume+that+the+adoption+of+a+solution%2C+a+technology+or+an+IT+product+by+an+institute+is+affected+by+the+willingness+of+a+user+to+use+it%2C+the+total+cost+to+own+it+and+its+environmental+influence.+This+framework%2C+referred+as+ACE+index+model+or+User+Adoption+Model+%28UAM%29%2C+integrates+the+index+of+user+acceptance%2C+the+index+of+total+cost+and+the+index+of+side+effect.+Ways+to+estimate+these+indices+are+outlined.+Approaches+to+aggregating+these+three+independent+indices+are+discussed+along+with+their+advantages+and+drawbacks.+A+case+study+is+presented+to+demonstrate+the+use+of+the+proposed+ACE+index+model.+We+hope+the+result+will+serve+as+a+good+reference+for+IT+management+staff+to+quantitatively+assess+and+compare+different+information+technologies%2C+IT+products+or+IT+solutions+to+make+a+final+decision+for+their+organization.+This+model+can+also+be+useful+for+relevant+industry+to+optimize+their+product+and+make+targeted+improvement.+Additionally%2C+the+idea+will+be+helpful+for+those+who+teach+IT+management+to+regulate+a+general+guideline+for+quantitative+evaluation+of+IT+product.',NULL,'Accepted as a Poster',1,638,'CFF943AQZ3','Accepted as a Poster'),
	(77,'Project-Based+Learning+Improves+Critical+Thinking+for+Software+Development+Students','In+the+software+development+%28SD%29+track+of+information+technology+majors%2C+upper-level+SD+courses+are+designed+to+combine+students%27+accumulated+programming+knowledge+to+develop+software+applications%2C+reaching+their+ultimate+goal.+Usually%2C+instructors+in+SD+courses+train+students+with+predefined+problems+having+known+solutions.+Instructors+aim+to+maximize+student+success+and+sense+of+achievement%2C+but+students+lose+motivation+when+they+realize+projects+are+trivial.+Students+practice+problem+solving+by+utilizing+previously-learned+knowledge+and+skills+but+they+are+not+required+to+use+critical+thinking%2C+creativity%2C+or+research.+As+an+alternative%2C+we+present+a+method+to+assign+students+novel+real-world+projects%2C+proposed+by+external+clients+who+direct+the+development+of+the+respective+software+product.+Our+hypothesis+is+that+our+real-world+project-based+approach+improves+STEM+competencies+for+critical+thinking%2C+problem+solving%2C+and+software+engineering+skills.+Furthermore%2C+we+expect+increases+in+student+motivation+and+engagement+that+may+result+in+a+bigger+sense+of+achievement.+In+two+sections+of+the+senior+level+undergraduate+Software+Development+2+course%2C+we+assessed+critical+thinking+skills+using+the+CAT+%28Critical+Thinking+Assessment+Test%29%2C+a+standard+instrument+developed+by+the+Tennessee+Tech+University%2C+and+found+a+significant+increase+between+the+beginning+and+end+of+the+semester.+Our+results+suggest+that+the+project-based+approach+to+teaching+software+development+increases+general+critical+thinking+skills%2C+but+its+effectiveness+can+be+further+scrutinized.+In+the+future%2C+we+would+like+to+provide+critical+thinking+exercises+more+specific+to+software+development%2C+and+also+develop+assessment+tools+for+problem+solving+skills+and+computing+attitudes.',NULL,'Accepted as a Lightning Talk',1,701,'0P9OHJVTJQ','Accepted as a Lightning Talk'),
	(78,'Balancing+Theory+and+Practice+in+IT+Curriculum%3A+New+Challenges+and+Solutions','Undergraduate+and+graduate+students+in+information+technology+need+a+balance+between+theory+and+practice+to+be+prepared+and+ready+for+the+workforce+and+long-life+self-learning.+What+are+the+core+IT+principles+students+from+developing+countries+should+learn%3F++How+are+the+undergraduate+and+graduate+information+technology+curricular+and+training+requirements+different+between+US+and+other+developing+countries%3F+This+enlightening+talk+discusses+the+differences+in+the+graduate+and+undergraduate+IT+training+requirements+between+US+and+developing+countries.+',NULL,'Accepted',5,159,'M9I4VELFF2','Accepted'),
	(79,NULL,NULL,NULL,NULL,5,705,'QYV4HGBICP',NULL),
	(80,'A+Comparison+of+Tools+for+Teaching+and+Learning+Data+Analytics','Data+analytics+have+become+popular+in+real-world+practice%2C+due+to+the+fact+that+the+corresponding+techniques+are+useful+in+understanding+data%2C+discovering+patterns+and+building+predictive+models.+Several+curricula+related+to+data+analytics+have+been+developed+in+worldwide+Universities+or+colleges.+As+a+practical+curriculum%2C+it+is+important+to+teach+necessary+and+useful+tools+or+software+for+students+to+better+learn+data+analytics.+However%2C+there+could+be+several+potential+choices+on+the+market.+In+this+paper%2C+we+compare+different+tools+%28e.g.%2C+R%2C+Python%2C+Weka%2C+Mahout%29+for+teaching+and+learning+data+analytics%2C+discuss+our+experience+in+the+educational+setting%2C+point+out+the+lesson+learned+and+also+present+the+feedbacks+from+the+students.',NULL,'Accepted as a Poster',1,208,'FYDQT3WOZB','Accepted as a Poster'),
	(81,'A+Course+on+Applied+AI+and+Data+Science%3A+Recommender+Systems','Artificial+intelligence+%28AI%29+and+data+science+have+become+one+of+the+most+popular+curricula+in+the+computing+educations.+Plenty+of+theories%2C+optimizations+and+math+are+involved+in+these+courses%2C+which+results+in+a+higher+degree+of+difficulty+for+students+to+learn%2C+not+to+mention+the+students+without+specializations+in+computer+science+or+information+technology.+Beyond+the+complicated+knowledge+and+theories%2C+students+may+prefer+to+learn+and+focus+on+applied+AI+or+data+science+which+refer+to+the+knowledge+or+skills+for+practical+problem-solving+and+real-world+applications.+For+example%2C+information+retrieval+has+been+listed+as+one+of+the+curricula+in+several+undergraduate+and%2For+graduate+programs+in+the+AI+or+data+science+programs.+This+paper+describes+a+course+that+focuses+on+the+topic+of+recommender+systems+which+is+in+high+demand+in+both+academia+and+industries.+This+course+has+been+extremely+successful+at+the+authors%27+institutions.+In+this+paper%2C+we+introduce+the+course%27s+objectives%2C+structure+and+methodologies%2C+discuss+possible+ways+to+deliver+hands-on+practice%2C+summarize+the+outcomes%2C+and+finally+present+the+lessons+learned%2C+as+well+as+the+feedbacks+from+the+students.+These+experience+could+be+useful+and+may+give+advice+to+other+educators+looking+to+create+a+similar+course+in+their+program.',NULL,'Accepted',1,208,'9XFJFR556Z','Accepted'),
	(82,'The+Effects+of+Native+Language+Consistency+on+Learners%E2%80%99+Introduction+to+Block-Based+Instructional+Technologies','Computer+Science+%28CS%29+is+an+English-centric+discipline+which+still+needs+to+explore+how+cultural+factors+such+as+learners%27+native+language+may+impact+the+understanding+of+CS+concepts.+We+evaluated+adult+participants+with+no+prior+coding+experience+performing+tasks+in+a+conventional+block-based+programming+platform%3A+Scratch.+We+collected+data+from+these+interactions+and+compared+between+Native-English+speakers%2C+and+Hispanic+speakers+who+knew+English+as+a+Second+Language+%28ESL%29.+Our+findings+suggest+that+learners%E2%80%99+native+language+may+not+impact+their+ability+to+come+to+a+proper+solution%2C+but+it+does+affect+how+they+interact+with+block-based+environments%2C+when+their+native+language+is+inconsistent+with+the+language+featured+in+the+tool.+This+pilot+study+invites+the+Computer+Science+Education+%28CS+ED%29+community+to+explore+how+to+effectively+reach+Hispanic+and+non-English+speaking+communities%2C+impacting+the+community+outreach+in+other+regions.',NULL,'Accepted as a Lightning Talk',7,706,'9JBOSJTA15','Accepted as a Lightning Talk'),
	(83,'Online+Learning%2C+The+Educators+Experiences','Much+has+been+researched+and+written+about+the+trials+and+techniques+of+imparting+education+to+students+in+technical+fields+like+Information+Technology+via+online+learning.++Even+more+work+has+been+done+about+the+students+experiences+in+online+courses.++What+this+panel+is+hoping+to+engender+is+to+start+a+discussion+about+online+learning+from+the+teachers%E2%80%99+point+of+view%2C+their+trials+and+tribulations.++It+is+our+hope+to+start+a+discussion+with+the+attendees+and+be+able+to+share+our+triumphs%2C+failures%2C+theories%2C+tools%2C+approaches+and+fears.++Attendees+need+no+personal+experience+in+online+teaching%2C+just+a+curiosity+of+what+the+endeavor+might+be+like.++Attendees+with+personal+experience+might+find+others+with+similar+experiences%2C+commiserate+and+hopefully+find+new+pathways+forward+together.',NULL,'Accepted',2,20,'RY7MNLX28T','Accepted'),
	(84,'How+to+Increase+Female+Enrollment+and+Retention+for+Computing+Degrees','Coming',NULL,'Accepted',2,94,'JX5OSP4QHA','Accepted'),
	(85,'Bikesharing%3A+Analysis+and+Prediction','As+one+of+the+most+popular+shared-economy+industries%2C+the+bikesharing+systems+are+in+ever-growing+demand+now%2C+and+there+are+currently+more+than+500+such+systems+operating+around+the+world.+A+typical+bike+sharing+or+rental+system+allows+the+users+to+rent+bike+from+one+location+and+return+it+at+any+other+locations+in+their+networks.+In+this+paper%2C+we+perform+the+statistical+and+predictive+analysis+on+the+bike+sharing+data+in+Washington%2C+D.C.+Our+experimental+results+help+discover+different+usage+patterns+by+the+registered+and+casual+users%2C+and+we+are+able+to+build+effective+predictive+models+to+estimate+the+rental+demands+in+the+bikesharing+system.',NULL,'Accepted',4,208,'WJBF7DUOTG','Accepted'),
	(86,'Software+Quality+and+Software+Security+with+Serverless+Computing','Nowadays%2C+organizations+are+moving+from+server-centric+traditional+compute+and+storage+systems+to+the+serverless+computing+that+offers+the+potential+benefits+of+not+requiring+their+servers.+Serverless+architecture+facilitates+superior+flexibility%2C+greater+scalability%2C+cost-cutting%2C+and+quicker+time+to+release.+However%2C+migration+from+legacy+infrastructure+to+the+serverless+one+is+a+vast+technical+change+which+may+emerge+other+issues.+The+purpose+of+this+paper+is+to+analyze+what+serverless+computing+can+impact+on+software+quality+and+software+security+if+the+legacy+system+is+re-engineered+or+modernized+using+serverless+computing.+We+compare+three+service+providers+such+as+Amazon+Web+Services%2C+Microsoft+Azure%2C+Google+Cloud+Platform+and+find+out+their+pros+and+cons.++',NULL,'Rejected',1,468,'7GYGM27AM6','Rejected'),
	(88,'An+Architecture+for+Blockchain-based+Collaborative+Signature-based+Intrusion+Detection+System','Collaborative+intrusion+detection+system+%28CIDS%29%2C+where+IDS+hosts+work+with+each+other+and+share+resources%2C+have+been+proposed+to+cope+with+the+increasingly+sophisticated+cyberattacks.+Despite+the+promising+benefits+such+as+expanded+signature+databases+and+alert+data+from+multiple+sites%2C+trust+management+and+consensus+building+remain+as+challenges+for+a+CIDS+to+work+effectively.+The+blockchain+technology+with+built-in+immutability+and+consensus+building+capability+provides+a+viable+solution+to+the+issues+of+CIDS.+In+this+paper%2C+we+introduce+an+architecture+for+a+blockchain-enabled+signature-based+collaborative+IDS%2C+discuss+the+implementation+strategy+of+the+proposed+architecture+and+developed+a+prototype+using+open-source+projects+such+Hyperledger+and+Snort.+Our+preliminary+evaluation+on+a+bench+mark+showed+the+proposed+architecture+offers+a+feasible+solution+by+addressing+the+issues+of+trust%2C+data+sharing+and+insider+attacks+in+the+network+environment+of+CIDSs.+The+implications+and+limitations+of+this+study+are+also+discussed.++',NULL,'Accepted as a Poster',7,695,'MV0VVNNIJG','Accepted as a Poster'),
	(90,'Exploratory+Analysis+of+Chicago+Taxi+Rides','Taxi+ride+is+still+one+of+the+most+common+and+popular+transportation+methods%2C+even+if+there+are+a+lot+of+different+options+provided+in+a+large+city%2C+such+as+New+York+and+Chicago.+In+this+paper%2C+we+utilize+the+taxi+ride+data+in+the+city+of+Chicago%2C+and+analyze+the+factors+that+are+most+significant+in+determining+the+fare+of+the+taxi+ride.+We+analyze+the+data+and+discover+some+interesting+patterns+in+the+taxi+ride+and+taxi+fares.+In+addition%2C+we+also+tried+to+predict+the+most+common+method+of+payment+for+the+fare+by+using+regression+and+classification+technique+respectively.',NULL,'Accepted',4,208,'JXFURI51BC','Accepted'),
	(91,NULL,NULL,NULL,NULL,5,714,'CY2QWDQKHT',NULL),
	(92,'Teaching+Cyber+Concepts+and+Ethics+by+Hacking+NAO','This+paper+introduces+our+novel+experiential-learning+model%2C+which+uniquely+combines+cybersecurity+with+robotics+in+the+form+of+an+ethical-hacking+experiment+on+the+NAO+humanoid-robot+for+teaching+cybersecurity+concepts+and+ethics.+Our+research+case-study%2C+as+described+in+this+paper%2C+involves+the+use+of+NAO+to+educate+both+college+and+pre-college+%28K-12%29+learners+about+basic+cybersecurity+topics%2C+like+fundamental+computer-networking+concepts%2C+simple+system-level+access+control+and+authentication%2C+as+well+as+the+essence+of+ethical-hacking.+This+teaching+experiment+is+carried+out+by+providing+a+sample+set+of+college+and+pre-college+learners+the+hands-on+opportunity+to+perform+a+simple+step-by-step+ethical-hacking+experiment+on+the+NAO%2C+and+in+the+process+explore+as+well+as+exploit+robotic+system+vulnerabilities.+Existing+literature+shows+that+there+is+limited+work+on+the+efficacy+of+teaching+ethical-hacking+related+cybersecurity+topics+using+an+actual%2C+physical+robot.+Prior+works+indicate+that+a+robotic+platform+can+be+an+effective+and+engaging+medium+for+teaching+cybersecurity.+However%2C+our+new+approach+of+teaching+essential+cyber+concepts+and+ethics+through+a+hands-on+offensive+and+defensive+exploration+of+the+NAO+is+a+first-of-its-kind+educational+research+study+with+college+and+pre-college+learners.+As+preliminary+evidence+of+the+effectiveness+and+potential+of+our+proposed+experiential+learning+model%2C+we+analyze+our+experimental+results%2C+in+the+form+of+student+learning+assessment+through+participant+feedback+and+learner+survey+data%2C+which+have+been+collected+from+the+several+NAO+ethical-hacking+workshop+sessions+that+we+have+conducted+with+different+learners%2C+including+college+students%2C+high-school+students+and+teachers+plus+few+elementary-school+youth.',NULL,'Rejected',1,301,'DTSR9GXBNE','Rejected'),
	(93,'Initial+Results+from+an+Applied+Baccalaureate+Program+in+Software+Development','Nearly+half+of+the+states+in+the+U.S.+now+authorize+community+colleges+to+confer+certain+baccalaureate+degrees%2C+typically+applied+baccalaureate+degrees+that+are+workforce-oriented.+Green+River+College%2C+a+community+college+located+in+a+suburb+25+miles+south+of+Seattle%2C+Washington%2C+launched+a+new+applied+baccalaureate+program+in+Software+Development+in+2014%2C+focused+on+preparing+students%2C+particularly+those+who+are+place-bound%2C+underrepresented+and+under-served%2C+to+access+entry-level+career+opportunities+as+software+developers.+This+lightning+talk+will+share+initial+results+from+a+five-year+retrospective+on+an+applied+baccalaureate+program+in+Software+Development+and+provides+the+author+an+opportunity+to+ask+for+feedback+from+SIGITE+community+members+on+what+other+factors+and+data+should+be+considered+to+provide+additional+value+in+the+retrospective.',NULL,'Accepted',5,696,'5KT98QJD2A','Accepted'),
	(95,'Deep+Learning+in+the+IT+Curriculum','Deep+learning%2C+a+form+of+neural-network+based+machine+learning%2C+is+becoming+prevalent+in+many+IT+endeavors.+It+is+therefore+important+to+expose+IT+undergraduate+students+to+it++somewhere+in+the+curriculum.+However%2C+deep+learning+has+mathematical+foundations+that+may+be+beyond+the+reach+of+the+average+undergraduate+student.+A+course+focusing+on+creative+AI+has+been+developed+to+introduce+deep+learning+from+the+practitioner+perspective.+Specifically%2C+the+application+of+deep+learning+in+human+creative+activities%2C+such+as+in+art%2C+music%2C+and+multimedia%2C+forms+the+basis+of+our+educational+approach.+The+major+topics+of+this+course+are+presented%2C+along+with+the+software+tools+being+utilized.+Sample+laboratory+assignments+and+projects+are+introduced%2C+and+the+results+of+measuring+various+student+outcomes+across+two+semesters+are+presented.+Overall%2C+the+use+of+deep+learning+in+applications+mimicking+human+creativity+can+serve+the+purposes+of+getting+students+excited+about+machine+learning+and+also+help+enhance+their+core+knowledge+of+programming+and+the+utilization+of+standard+library+tools.',NULL,'Accepted',1,720,'0GAI31YHQZ','Accepted'),
	(96,'Redeveloping+Electronic+Health+Records+Course+with+Open+Source+Tools+and+Platforms','In+this+paper%2C+we+introduce+the+redevelopment+of+Electronic+Health+Record+Systems+and+Applications+course+for+health+information+technology+students.+We+make+use+of+open-source+tools+and+platforms+in+the+hands-on+projects+to+help+students+understand+the+topics+through+learning+by+doing.+The+course+redevelopment+details+are+presented%2C+students%E2%80%99+perceptions+of+the+course+materials+and+future+plan+are+discussed.',NULL,'Accepted as a Poster',1,32,'2ZN3KXHTBX','Accepted as a Poster'),
	(97,'The+Use+and+Non-Use+of+Cybersecurity+Tools+Among+Consumers%3A+Do+They+Want+Help%3F','Cybersecurity+behavior+changes+over+time%2C+as+do+the+recommendations+for+how+one+may+best+protect+themselves+from+cybersecurity+threats.+This+paper+examines+current+trends+in+what+protective+measures+people+take%2C+such+as+using+a+password+manager%2C+virtual+private+network+%28VPN%29%2C+or+anti-malware+software.+The+reasons+why+people+employ+these+protective+measures+is+explored%2C+including+why+some+choose+not+to+and+whether+or+not+they+are+willing+to+pay+for+cybersecurity+protective+services%2C+including+on-call+expert+access.+The+evidence+indicates+that+there+is+an+important+place+for+security+education%2C+training%2C+and+awareness+%28SETA%29+programs+to+help+those+that+do+not+use+such+measures%2C+as+well+as+concerted+efforts+to+improve+the+self-efficacy+of+individuals%2C+especially+females+and+adults+35+and+over.+About+one+in+three+individuals+are+willing+to+pay+for+cybersecurity++services+that+include+on-call+access+to+cybersecurity+experts.+However%2C+establishing+a+proper+price+point+for+such+services+remains+critical.+',NULL,'Accepted',7,96,'6Y1BDT0QUU','Accepted'),
	(98,'Analysis+of+Threats+to+UAV+Operations++in+Education+and+Research+','Unmanned+aerial+vehicles+%28UAVs%29%2C+more+commonly+known+as+%E2%80%9Cdrones%E2%80%9D%2C+have+been+used+for+military+and+law+enforcement+purposes+for+decades%3B+however%2C+recent+years+have+seen+UAVs+become+pervasive+in+a+variety+of+civilian+enterprises%2C+from+filmmaking+and+agriculture+to+hobby+flying+and+racing+as+well+as+for+research+purposes+in+the+university+setting.+This+incredible+versatility+also+provides+an+equally+large+and+diverse+array+of+potential+attack+vectors+that+a+malicious+actor+can+exploit+to+gain+control+over+a+UAV+or+the+various+wireless+networks+it+uses+to+communicate.+This+has+led+to+a+large+body+of+research+regarding+what+these+vulnerabilities+are+and+how+they+can+be+mitigated+or+eliminated.+These+problems+are+amplified+when+conducted+under+the+banner+of+research+and+academic+freedom.+The+purpose+of+this+paper+is+to+collect%2C+discuss%2C+and+analyze+these+threats+to+UAV+operations+in+order+to+establish+a+baseline+for+further+research',NULL,NULL,7,397,'Y01MRCVTAS',NULL),
	(99,'From+Design+to+Implementation+-+Algorithm+Conversion+and+Transition+to+a+Mobile+Platform+for+an+Artificial+Pancreas','An+artificial+pancreas+is+implemented+as+a+mobile+application+which+connects+glucose+sensor%2C+insulin+pump+and+wearable+physical+activity+sensors+and+automatically+delivers+the+optimal+insulin+amounts+for+type+1+diabetes+patients.+The+automation+of+insulin+delivery+is+based+on+an+algorithm%2C+previously+tested+on+a+laptop+and+still+under+development%3A+the+complexity+of+such+algorithms%2C+and+its+ongoing+changes%2C+requires+a+fast%2C+reliable+method+to+translate+the+same+functionalities+into+a+mobile+platform.+Neither+precision+nor+the+runtime+constraints+can+be+neglected%2C+for+it+would+incur+in+safety+hazards%3A+wrong+or+delayed+treatment.+Consequently%2C+correctness+tests+of+the+new+mobile+application+results+and+on+the+phone+run+time+analysis+are+presented+at+the+end+of+the+document.',NULL,'Accepted as a Lightning Talk',1,599,'B8CNCK0VNV','Accepted as a Lightning Talk'),
	(100,'The+Necessity+of+Inter-Disciplinary+Software+Development+for+Building+Viable+Research+Platforms','Developing+viable+and+robust+software+is+an+inescapable+artifact+of+graduate+research.+In+addition+to+the+complexity+of+the+graduate+research%2C+you+have+now+added+additional+complexity+of+developing%2C+deploying%2C+and+securing+software+to+aid+or+complete+the+initial+research.++Combined+with+the+transitive+nature+of+students%2C+this+further+complicates+the+development+process.++What+is+needed+is+a+standardized+framework+for+developing+complex+software.+++We+posit+that+in+a+university%2C+no+single+department+has+the+internal+expertise+to+produce+research+and+the+necessary+software+development+and+infrastructure+needed+to+produce+a+viable+product+or+tool+used+in+a+research+capacity.++We+would+extend+the+research+of+Hilton+et+al.+%5B5%5D+stating+that+developing+software+in+a+research+context+facilitates+the+necessity+that+software+should+be+designed+as+interdisciplinary+from+the+beginning.',NULL,NULL,7,397,'YTH9OGNAKK',NULL),
	(101,'Building+an+Ecosystem+of+Strategic+Partners+for+New+Baccalaureate+Programs+in+Information+Technology','In+2017%2C+technology+startup+Tapped+Technologies+partnered+with+students+in+a+relatively+new+applied+baccalaureate+program+in+software+development+at+Green+River+College+to+develop+a+sports+fan+engagement+platform%2C+resulting+in+the+business+being+able+to+pursue+first-round+investor+funding+and+students+being+hired+as+software+developer+interns.+Strategic+partnerships+with+local+businesses+and+non-profit+organizations+provide+students+with+opportunities+for+tuition+funding%2C+project-+and+work-based+learning%2C+while+providing+organizations+access+to+local+talent+and+the+college+with+storytelling+opportunities+for+program+marketing.+In+this+lightning+talk%2C+learn+how+effective+partnerships+are+formed+and+sustained%2C+from+both+the+academic+program+and+the+partners%E2%80%99+perspective.',NULL,'Accepted',5,696,'GJGSVN1FO6','Accepted'),
	(102,'Closing+the+Feedback+Loop+Between+UX+Design%2C+Software+Development%2C+Security+Engineering%2C+and+Operations','+There+have+been+many+evolutions+of+the+software+development+lifecycle+%28SDLC%29.+These+differing+models+have+moved+software+development+groups+from+sequential+development+to+a+more+agile+and+iterative+development+model.+With+the+increasing+awareness+and+research+focused+on+the+cyber+security+landscape%2C+there+has+been+a+large+push+for+%22shifting+security+left%22+in+the+SDLC.+With+security+engineering+teams+engaged+earlier+and+more+often+throughout+the+SDLC%2C+security+issues+will+be+found+and+fixed+earlier%2C+which+increases+efficiency+while+lowering+cost+and+overhead.+While+this+has+been+an+important+cultural+and+infrastructural+shift+for+many+technology+companies%2C+there+is+still+a+gap+in+this+feedback+loop+that+needs+to+be+bridged%3A+the+gap+between+user+experience+designers+and+the+software%2C+security%2C+and+IT%2Foperations+engineers.+With+the+introduction+of+more+security+awareness+and+implementation+of+security+controls%2C+there+have+been+trade-offs+made+between+security+and+usability---a+challenge+known+as+%22Usability+versus+Security.%22+Many+of+the+articles+and+papers+that+propose+how+to+change+these+two+fields+from+opposing+forces+to+being+cross-functional+allies+offer+simplified+solutions+but+don%27t+go+into+granular+detail+about+solving+the+problem.+This+paper+covers+the+evolution+of+the+SDLC+from+the+Waterfall+model+through+the+DevSecOps+agile+methodology+and+proposes+a+new+development+model%3A+the+Technology+Development+Lifecycle+%28TDLC%29.+This+TDLC+model+aims+to+keep+designers%2C+software+engineers%2C+security+engineers%2C+and+IT%2Foperations+all+within+a+tight+feedback+loop+throughout+a+continuous+integration%2Fcontinuous+development+pipeline.+We+will+discuss+various+workflows%2C+use+cases%2C+and+technologies+that+can+be+used+later+on+to+implement+a+working+environment+that+can+enforce+the+TDLC+model.',NULL,'Accepted',7,96,'Z9P944J6W2','Accepted'),
	(103,'Pedagogical+Strategies+for+Classroom-based+Mixed+Reality+%28MR%29+Technology+Curriculum+','As+Mixed+Reality+%28MR%29+technologies+continue+to+become+more+prevalent%2C+it+is+important+to+design+and+prototype+user-centered+systems+that+integrate+the+kinds+of+interface+and+interaction+components+that+are+most+effective+for+consumers+to+use.+Integration+of+these+concepts+into+the+topics+we+currently+teach+is+critical+to+the+career+trajectory+of+our+students.+In+this+article%2C+we+discuss+pedagogical+strategies+for+how+to+transform+IT+education%2C+including+design+thinking-based+approaches%2C+that+have+shown+useful+to+the+rapid+design%2C+prototyping%2C+and+integration+of+MR+technologies+and+concepts+into+classroom-based+curriculum.+Lessons+learned+from+the+formal+introduction+of+these+concepts+into+the+curriculum+at+Brigham+Young+University+%28BYU%29+during+a+longitudinal+12-month+period+and+the+creation+of+a+new+MR+Lab+on+campus+will+also+be+discussed.',NULL,'Accepted',1,389,'XRF02XQCBC','Accepted');
